(92, 'Válvula  Llave Pedal Trafico Pesado Metálica Institucional', '123456789', ' Cuerpo y pico fabricados en bronce. Llave de pedal. Repuesto en bronce con opturacion por presión.- Sistema de cierre Automático .- Incluye chazos expansivos para instalar al piso..- Recomendado para uso de fregaderos de cocina, lavamanos o en lavanderí­as.CARACTERÍSTICAS:- Superficie libre de defectos o ralladuras.- Producto probado para resistir oxidación o corrosión.- Funcionamiento adecuado desde 20 hasta 125 PSI.- Sistema de cierre probado hasta los 500.000 ciclos, sin presentar fugas.- Sistema de cierre probado hasta las 500 PSI, sin presentar fugasEntregamos factura con IvaServicio posventa para procesos de garantí­a.', 99900, 1, 79, 5, 5, 1, '474483804');
INSERT INTO `tblPublicacion` (`idPublicacion`, `nombrePublicacion`, `docIdentidadPublicacion`, `descripcionPublicacion`, `costoPublicacion`, `puntuacionPublicacion`, `cantidadPublicacion`, `stockMinPublicacion`, `categoriaPublicacion`, `validacionPublicacion`, `urlData`) VALUES
(93, 'Ableton Push 2 Controlador Con Live 10 Suite - Audiotecna', '123456789', '-Somos AUDIOTECNA, distribuidores para Colombia de ABLETON-Pack Ableton Push 2 + Live 11 Suite para dos computadores_¡_¡Disponible para entrega inmediata!!Un combo compuesto por el controlador Ableton Push 2 y el software Ableton Live 11 Suite_¡ATENCIÓN!Te llevas la licencia 11 Suite por el precio que en USA consigues la Live 11 Intro, además tienes derecho a 4 horas de inducción donde te explicaremos las posibilidades y el manejo del Ableton push.DETALLES DEL PRODUCTO:ABLETON PUSH Y LIVE 11 SUITEAbleton Push y Live funcionan conjuntamente a la perfección para ofrecer lo mejor de ambos mundos: un hardware práctico para crear desde cero, y un completo programa de software para afinar y dar un acabado a su tema. El nuevo Push ahora pone en la yema de sus dedos incluso más elementos de ayuda para la creación de temas. Reproduzca y programe ritmos, melodí­as y armoní­as. Use nuevos flujos de trabajo de muestreo para cortar muestras (samples) a lo largo de los pads, reproducir golpes únicos o reproducir muestras con estiramiento temporal. Navegue, realice una vista previa y cargue de forma rápida cualquier elemento de su librerí­a de sonidos e instrumentos. Y con unos pads más suaves y con mayor respuesta y un visor multicolor que se adapta para mostrar exactamente lo que necesita, Push ofrece ahora un todaví­a mejor nivel de manejo.Push:Push ahora está diseñado y concebido enteramente por Ableton para conseguir una experiencia en la composición musical tan práctica, expresiva y estrechamente integrada con Live como sea posible. Push y Live ahora funcionan juntos a la perfección para que cree ritmos, toque notas y acordes, trabaje con muestras y desarrolle una estructura de un tema â€“ todo sin necesidad de mirar el computador.Crear ritmos:Push le permite navegar, previsualizar y cargar sus propios sonidos para la creación de ritmos, o acceder a la enorme librerí­a de sonidos de baterí­a de Live. Luego podrá tocar ritmos en directo con los 64 pads sensibles a la velocidad y ajustar sonidos y kits mientras toca, usando ocho encoders infinitos sensibles al tacto. O cambiar a un modo de 16 pads que le permite tocar en tiempo real, secuenciar ritmos por pasos y ajustar la duración de su loop, todo al mismo tiempo. También puede modificar la temporalización, la velocidad y valores de parámetros de forma individual para cada pad.Toque notas y acordes:Los pads de Push se corresponden con alturas tonales, y ofrecen una disposición resumida que favorece un nuevo enfoque respecto a la melodí­a y armoní­a: se pueden alcanzar grandes intervalos de forma sencilla y es posible reproducir patrones con la misma digitación en todas las teclas. Es posible seleccionar una clave y una escala con sólo pulsar un botón, y el deslizador táctil de Push puede usarse para estiramiento tonal o modulación.Push también le permite secuenciar notas y acordes por pasos: use los pads para introducir notas, luego aplique cambios de tiempo con precisión, cree variaciones o ajuste la duración de las notas y la velocidad. Puede incluso secuenciar por pasos la automatización: grabar el valor de un parámetro en cada paso para crear cambios del parámetro rí­tmicos y cuantizados que están fijados a notas especí­ficas en su loop.Trabajar con samples (muestras):Tres flujos de trabajo distintos ofrecen formas rápidas y flexibles de ser crativo con sus muestras. El modo Slicing le permite rebanar al instante muestras largas y reproducir cada rebanada sobre un pad distinto â€“ esto es ideal para reorganizar loops al vuelo o para crear kits de baterí­a a partir de grooves grabados. El modo Classic le permite convertir muestras melódicas en instrumentos tonales listos para tocar, y puede usar los encoders para definir los puntos de inicio y final así­ como el ataque, decaimiento, sostenido y desvanecimiento para cada uno.En el modo One Shot, las muestras se reproducen de forma monofónica y por toda su duración, sin importar hasta cuanto pulse el pad â€“ perfecto para tocar sonidos de baterí­a. También es posible transponer una muestra que esté sonando sin tener que volverla a disparar, permitiéndole transformar frases melódicas en melodí­as totalmente nuevas.Cada elemento en Push ha sido cuidadosamente reconsiderado para ofrecer una experiencia de manejo muy mejorada. El visor multicolor se adapta para mostrarle exactamente lo que necesita para mantenerle dentro del flujo creativo sin añadir distracciones. Los nuevos pads de Push han sido cuidadosamente rediseñados para ofrecer un taco más suave y una mayor respuesta â€“ es perfecto para crear ritmos y melodí­as expresivas.Push se comporta igual de bien tanto en el estudio como en el escenario. Puede guardar sus interpretaciones del momento cambiando entre improvisar con loops y tocar una baterí­a, notas y acordes â€“ todo desde la misma superficie de manejo.Usando Push, puede lanzar clips y escenas, manipular parámetros de dispositivos y controlar niveles de mezcla y enví­os â€“ Live es capaz de capturar cada momento. Cuando esté listo, cambie de Push a su ordenador para ver su música ya completamente colocada y estructurada en Live â€“ el software que guiaba su trabajo todo el tiempoCaracterí­sticas principales:_ Instrumento hardware para un manejo interpretativo con Ableton Live 11_ Toque o secuencie por pasos ritmos, notas, acordes y automatización_ Nuevos flujos de trabajo de muestreo: recorte, toque y manipule muestras desde Push_ El gran visor multicolor se adapta para mostrar lo que necesita_ 64 pads retroiluminados sensibles y manejables _ 8 encoders sensibles al tacto para controlar el mezclador, dispositivos e instrumentos, y el funcionamiento del navegador de Live_ Modo de lanzamiento de clips para la grabación de arreglos e interpretación en directo_ El modo Scales ofrece un enfoque exclusivo para la reproducción de notas y acordes_ Incluye Live Suite, la versión más completa del software.Especificaciones técnicas:Incluido:El hardware Push:Fuente de alimentación universal 100-240VAC, 50/60Hz con cabezales intercambiables para Norte/Central America & Japón, Europa y UK (Tipo A, C, G)Cable USBGuí­a de inicio rápido + descarga de la versión de Live 10Dimensiones:_ Ancho: 370mm (14.57 pulgadas)_ Profundidad: 293mm (11.54 pulgadas)_ Altura (cuerpo): 26mm (1.02 pulgadas), (cuerpo + encoders): 46mm (1.81 pulgadas)_ Peso: 2990grs (6.6 libras)Conexiones:1. Corriente externa: 12V DC 1.25A2. Corriente USB: 5V/0.5A3. Dos entradas de pedal4. Ranura se seguridadCarcasa:El armazón superior es una placa gruesa aunque ligera de aluminio anodizadoPads_ Pads suaves de silicona, calibrados cuidadosamente para responder perfectamente a cualquier velocidad_ Retroiluminación RGBBotones:Los botones de control tienen una suave pulsación y se iluminan en blanco o con LEDs multicolor para indicar una variedad de estadosEncoders:Encoders infinitos de alta resolución que responden al tactoVisor:El visor RGB de alta resolución es brillante y claro en cualquier ángulo de visión y bajo cualquier iluminaciónTira táctil (touchstrip):_ Tira táctil de 17 cm para pitch bend/scrolling_ 31 LEDs para navegaciónAbleton Live y PUSH son utilizados por artistas como Meridian Brothers, Skrillex, Daft Punk, Morton Subotnick, Lucrecia Dalt, Andrea Parker, Pernett, Pantha du Prince, Four Tet, Moldover, Q-Tip, Flying Lotus, Matmos, Mouse on Mars, St. Vincent, Cut Copy y muchos-----------------------------------------------------------------------Audiotecna es distribuidor oficial de Moog Music (sintetizadores que inspiraron a Roland, Korg y Yamaha), Ortofon (similar a Shure y Audio-Technica), Teenage Engineering (Pocket Operators y OP-1), Ableton (Live y Push), Dubreq (Stylophone), Koma Elektronik y Livid Instruments (productos similares a M-Audio, AKAI) para Colombia, como se puede comprobar en la página de los fabricantes. Contamos con el surtido completo de todas las marcas, estamos en contacto con el equipo de soporte técnico continuamente y asesoramos a los clientes en el proceso preventa, posventa y en caso de garantí­a también.Tenemos nuestro punto de despacho en la localidad de Usaquén en Bogotá (Contador) desde el cual distribuimos los productos a más de 50 ciudades diferentes de Colombia y un Showroom (sala de exhibición) en el sector de Galerí­as.------------------------------------PROCESO DE COMPRA:_¡Recuerda que ofertar es un compromiso de compra!NO hagas clic en Comprar si no tienes el dinero ni estás seguro de llevar el producto.Podrás ser calificado negativamente si no te llevas el producto inmediatamente.Contamos con los productos para entrega inmediata, se despacha desde la localidad de Usaquén en Bogotá. Puedes pasar por el producto cita previa.Solo recibimos pagos de contado. Si estás fuera de Bogotá, puedes hacer una consignación en nuestras cuentas bancarias Davivienda o Bancolombia (posibles recargos no se incluyen en el precio), o a través de un giro.Si se recibe el pago antes de las 4pm, se entrega a la empresa de mensajerí­a el mismo dí­a.Tarda un dí­a hábil a ciudades principales, el precio del transporte varí­a de acuerdo al destino.', 3190000, 4, 101, 5, 9, 1, '474549583'),
(94, 'Mochila Morral Maleta Bolso Quechua 10 Litros Deportivo', '123456789', 'Bolso Maleta Maletin 10 Litros Senderismo Deportivo QuechuaDisponible en colores:Morado con fucsia, Fucsia con vino tintoGris OscuroAzul Oscuro con agua marinaVerde MentaMedidas: 40 x 23 x 10 (Alto x Ancho x Profundo).Capacidad 10 LitrosVentilación Espaldar y correas sencillos sin sistema de ventilación.COMPARTIMENTACIÓN: 1 bolsillo con cremallera.COMODIDAD DE Transporte Espaldar y correas acolchados / Reposapulgares.RESISTENCIA A LA Fricción: Garantí­a de 10 añosGARANTÍA 10 Años_¿Qué daños cubre la garantí­a?Desgarres de cosidos, mal funcionamiento cremalleras, costuras,_  cierres defectuosos_¿Qué daños no cubre la garantí­a ?Decoloración, agujeros, desgarros y rotura en tejido, reparaciones personales.', 22900, 4, 113, 5, 1, 1, '474925376'),
(95, 'Impresora Termica 58mm Col  Pos Usb Punto De Venta Almacenes', '123456789', 'IMPRESORA TERMICA DE ALTA VELOCIDAD DE 58 MM POS IMPRESORA DE RECIBOS TÉRMICA (NEGRO USB)DE ALTA CALIDAD, BAJO NIVEL DE RUIDO, IMPRESORA DE RECIBOS DE ALTA VELOCIDAD (58 MM ROLLO DE PAPEL TÉRMICO)VELOCIDAD DE IMPRESIÓN 90 MM SDURACIÓN DEL CABEZAL 100 KILÓMETROSCONTROLADORES WIN 9X WIN 2000 WIN2003 WIN XP WIN VISTA WIN 7 WIN 8 WIN 10 LINUXCARACTERÍSTICAS DEL PRODUCTO_· BAJO CONSUMO DE ENERGÍA, BAJOS COSTOS OPERATIVOS (SIN CINTAS, CARTUCHOS DE TINTA)_· APOYO EFECTIVO CONDUCCIÓN CAJÓN_· ESTRUCTURA DE CARGA DE PAPEL FÁCIL, ESTRUCTURA RAZONABLE, FÁCIL DE USAR DE MANTENIMIENTO_· CONSTRUIDO EN BíšFER DE DATOS (PARA LA IMPRESIÓN PUEDEN RECIBIR DATOS DE IMPRESIÓN)_· COMANDOS DE IMPRESIÓN COMPATIBLES ESC POS ESTABLECIDO. ADECUADO PARA WINDOWS2000,DESCRIPCIÓN DEL PRODUCTOINTERFAZ DE COMUNICACIÓN DE PUERTO OPCIONAL PARALELO O PUERTO SERIE, CARÁCTER SE PUEDE AMPLIAR CON LA IMPRESIÓN, ASÍ COMO EL AJUSTE DEL ESPACIO DE UNA LÍNEA DE CARACTERES.EL APOYO DE DIFERENTES DENSIDADES DE MAPA DE BITS Y DESCARGA DE LA IMPRESIÓN GRÁFICA,APOYO A LA TRAMA DE IMPRESIÓN DE MAPA DE BITS EN EL CONTROLADOR DE IMPRESIÓN (MODO), A IMPLEMENTAR Y LLAMAR A LA PALABRA DURO BANCO DE IMPRESIÓN DE ALTA VELOCIDAD.APOYO A 26 IDIOMAS INTERNACIONALES Y BAJO RUIDODIMENSIONES APROX 18 x 10 x 10 cm.EL PAQUETE INCLUYE1 IMPRESORA TÉRMICA1 MANUAL DE INSTRUCCIONES1 ADAPTADOR DE CORRIENTE1 CABLE USBLA IMPRESORA ES TERMICA Y NO NECECITA NINGUN TIPO DE TINTA O CONSUMIBLE.PARA CONCEPTO DE GARANTÍA O RETRACTO, EL CLIENTE DEBE ASUMIR LOS COSTOS DE LOS ENVÍOS', 116900, 1, 20, 5, 7, 1, '475386128'),
(96, 'Hidrolavadora Electrica Karcher K1 Mx 1450psi, 270l/h.', '123456789', 'Hidrolavadora Karcher K1 *MX 1450psi, 270l/h. Ideal para superficies pequeñas-uso DOMESTICOSu consumo de energí­a es de 1200W con sistema de Autostock, que permite ahorrar energí­a y prolongar la vida útil de tu equipo. Disponible en color amarillo.Su cuerpo está fabricado en Poliamida para mayor resistencia y fácil limpieza.Pesa 4,2 kg. Ideal para un transporte más ligero en tu hogar. Su caudal de 5 Lts./minuto te permite ahorrar hasta un 80% más que una manguera de jardí­n. Cuenta con cable de 5 metros de largo para desplazarte de un lugar a otro. Somos Especialistas en Maquinaria y Herramientas para la Construcción, Agro e Industria, importadores y distribuidores de las mejores marcas, contamos con 4 sedes a nivel nacional y mas de 15 años de experiencia. Realizamos enví­os a todo el paí­s con servicio postventa. Nuestra prioridad es garantizarle el mejor servicio por eso le brindamos acompañamiento personalizado en el proceso de cada Compra, Enví­o y Entrega Final. Todos nuestros productos se encuentran en Colombia,( Mercado Libre muestra una fecha estimada, tan pronto esté en camino su compra, tendrá la información de seguimiento en mercado libre a la mano para que pueda saber dónde está su enví­o en todo momento, en la opción Seguir enví­os ). Los productos originales pueden variar ligeramente respecto a las fotos. _¡Somos Equipmaster y estamos para servirle!', 369900, 1, 35, 5, 10, 1, '477184722'),
(97, 'Mesa De Centro Amoblando Italia', '123456789', 'ENVÍOS:Consulte los costos de enví­o en la parte superior de la publicación, si su destino no aparece en el listado evite realizar la compra.ENTREGA Y TIEMPO DE ENTREGA:Consulte los tiempos de entrega en la parte superior de la publicación. El producto será entregado en la puerta de su casa. Antes de comprar, cerciórese de que la mercancí­a cumpla con las dimensiones de acceso a su domicilio (pasillos, puertas, escaleras/ascensor), en caso contrario será entregado en el primer piso.OBSERVACIONES GENERALES:Imágenes de uso referencial. Los colores pueden diferir un poco de la realidad según la configuración de su pantalla. COLCHONES: La forma del acolchado puede variar sin alterar la calidad del mismo. Algunos colchones vienen en presentación enrollada, este método de empaque no compromete el producto. BASECAMAS: son armables práctica y fácil de instalar, posee herrajes para ensamblar las diferentes piezas. Incluye instructivo detallando el paso a paso para ensamblar las diferentes piezas. LENCERÍA: Las almohadas se encuentran comprimidas al vací­o, al retirar del empaque volverán a su forma natural en cuestión de minutos. Este método no compromete su calidad ya que sus fibras siliconadas son indeformables. Aplica también para plumones y otros productos. MUEBLES: Los soportes se encuentran dentro de un compartimiento ubicado en una de sus esquinas, retire la tapa con velcro y realice una apertura en la malla para acceder a los soportes. Una vez que extraiga los soportes coloque de nuevo la tapa con velcro Algunas referencias requieren instalación de patas, todos los elementos vienen incluidos en su compra. Debe atornillarlas en las cuatro esquinas de la base del mueble, (donde siente unos triángulos de madera).PETICIONES, QUEJAS Y/O RECLAMOSCualquier sea su duda comuní­quese con nosotros por los mensajes internos de la compra antes de realizar un reclamo para así­ poder brindarle ayuda de forma mas rápida.', 598000, 2, 38, 5, 5, 1, '480243663'),
(98, 'Controlador Alesis V49 49 Teclas Midi Usb V 49 Envio Gratis', '123456789', 'Controlador Alesis V49 49 Teclas Midi Usb V 49 ENVIO GRATISEN AKITA MUSIC MANEJAMOS FACTURACION LEGAL CON IVA Y GARANTIA DIRECTA / ENVIOS A NIVEL NACIONAL.Alesis V49 Teclado Controlador MIDI Detalles.El controlador de teclado MIDI Alesis V49 consta de 49 teclas y 8 pads sensibles a la velocidad, y ofrece un control completo de software DAW. Alesis ha incluido una serie de pads, botones y perillas intuitivas que te permiten añadir expresión, variedad y dinámica a todas tus actuaciones rápidamente y sin esfuerzo.Los bloques de construcción para cualquier productor de la músicaLa Alesis V49 es un controlador MIDI potente e intuitivo que le permite tomar el mando de tu software de música con un series de pads, las botíƒ_³ns y botones. 49 full-size sensible a la velocidad de teclas y botones de octava arriba/abajo, se puede expandir el teclado a la gama completa melódica y tocar lí­neas de bajo, acordes y melodí­as. V49 también cuenta con cuatro botones para manipular los instrumentos virtuales y plugins de efectos y botíƒ_³ns asignables: abrir y cerrar filtros, ajustar niveles de volumen, activar efectos, modificar parámetros y mucho más. Ocho retroiluminada sensible a la velocidad pads que te permiten lanzar clips o tambor con respuesta excepcional del dedo, y ruedas de pitch y modulación de amplí­an las capacidades expresivas de su realización.Software plug-and-GoV49 fue diseñado para integrar perfectamente y sin esfuerzo con tu software de música. Una simple conexión USB a su Mac o PC proporciona la potencia y funcionalidad MIDI, permitiendo que usted enchufe derecho en el ordenador y empezar a hacer música. Todas las botíƒ_³ns, botones, y pads ilumina para proporcionar comentarios visuales en tiempo real y son establecidos para un flujo de trabajo intuitivo. Además, diseño compacto de V49 facilita este potente controlador MIDI en el camino o implementarlo en cualquier estudio de tamaño.Ableton Live Live & XPAND! 2V49 se lí­a con Ableton Live Live 9 Lite y Xpand! 2 de AIR música Tech, dos dinámicas piezas de software que permiten grabar, producir y realizar con el ordenador. Ableton Live Live 9 Lite es un entorno fluido audio/MIDI que le permite registrar espontáneamente, remix, improvisar y editar ideas musicales sobre la marcha. Xpand! 2 es un instrumento virtual avanzado que viene con una colección de premium sonidos, que van desde instrumentos acústicos a sintetizadores futuristas. Juntos, estas plataformas de música potente que pueda crear o interpretar la música con V49 derecho fuera de la caja.Caracterí­sticas49 teclas de tamaño completo, frente a la Plaza8 retroiluminada sensible a la velocidad pads para vencer a producción y lanzamiento de clip4 botíƒ_³ns asignables y 4 botones asignables interfaz con el software de músicaOctava arriba y abajo de los botones le permite access el rango de teclado completoRuedas de pitch y modulación entregan expresiva, creativa controlEntrada para pedal de mantenerRetroalimentación visual, sin costura, mediante botones iluminados y controlesAlimentación USB y conectividad USB-MIDI para Mac y PCIncluida software de producción: Ableton Live Live 9 Lite y Xpand! 2 de AIR música Tech (descargas)IncluidoV49 Controlador USB-MIDICable USBAbleton Live Live Lite (descargar)Xpand! 2 de AIR música tecnologí­a (descargar)Guí­a del usuarioManual de garantí­a y seguridadEN AKITA MUSIC MANEJAMOS FACTURACION LEGAL CON IVA Y GARANTIA DIRECTA / ENVIOS A NIVEL NACIONAL.', 630000, 5, 11, 5, 9, 1, '483851590'),
