(128, 'Carpa Coleman Doble Tendido 4 Personas Tienda De Campaña ', '123456789', 'TIENDA OFICIAL COLEMAN_ especializados en equipos y accesorios en la categorí­a Outdoor para el disfrute de las actividades recreativas al aire libre, como excursión, camping, playera, hogar y accesorios.Horario de Atención: lunes a viernes de 9:00 am 6:00 pm y sábados de 9:00 am a 11:00 pm.DESCRIPCIÓN DEL PRODUCTO- Dimensiones: 140 cm (Alto) x 260 com (Ancho) x 200 cm (Largo).- Resistencia: 35+ MPH / 56+ KPH.- Util y eficaz.- Color agradable para la vista.- Ligera y de fácil instalación.- Probada en lluvias y viento.- Casa de campaña tipo domo.- Se arma en aproximadamente 8 minutos.- Materiales 100% de alta calidad y resistencia._¿CÓMO COMPRAR?:PAGOS:- MercadoPagoENVÍOS:- Mercadoenví­os- Coordinadora Mercantil (Contra entrega)RECOMENDACIONES:- Por favor aclare todas tus dudas en la sección de preguntas antes de ofertar.- Siempre consúltenos la disponibilidad del color, la talla o el tamaño de su preferencia.- Actualice el teléfono, correo y dirección para poder contactar y enviar el producto correctamente. No nos hacemos responsables por -contratiempos causados por datos erróneos.- Las compras acreditadas antes de las 2:30 pm serán enviadas el mismo dí­a hábil. Después de las 2:30 pm el enví­o se realizará el dí­a hábil -siguiente. PREGUNTAS FRECUENTES:1. _¿Hacen enví­os a todo el Paí­s?Si. A través de Mercado enví­os y Coordinadora Mercantil (Contra Entrega).2. _¿Desde qué ciudad realizan los enví­os?Todos nuestros productos son despachados desde nuestro almacén en Bogotá.3. _¿Puedo retirar mi producto personalmente?Si. Por nuestra sede en Bogotá, Fontibón.GARANTÍA:- Todos nuestros productos están garantizados por 3 meses contra defectos de fábrica.- La garantí­a no cubre abuso, descuido, mal uso o desgaste natural por el us', 278900, 2, 108, 5, 1, 1, '525762935'),
