(130, 'Mortero Refractario. 1500 C\' - kg a $1520', '123456789', 'MORTERO REFRACTARIO. (REFRACTARIOS DE COLOMBIA)Es una mezcla seca de materiales refractarios molidos y aditivos aglutinantes de excelente calidad, de una baja densidad, mayor porosidad para aumentar su resistencia al choque térmico, abrasión y erosión, Resistente a 1500_°centí­grados. Lista para solo adicionar agua dándole 1 dí­a de fraguado como mí­nimo. Es un producto especial para preparar morteros de mamposterí­a refractaria con requerimientos NO estructurales. Diseñado para mejorar la trabajabilidad del mortero y la liberación de humedad. Aplicaciones:Elaboración de morteros para pega de ladrillos o piezas refractarias. Instrucciones de uso:Tener en cuenta las recomendaciones de seguridad impresas en el empaque. Por cada bulto de 25 kg agregar 10 litros de agua mas o menos según la aplicación hasta obtener una mezcla homogénea, para luego impregnar las piezas con un espesor de 1mm a 10mm.Caracterí­stica técnicas:Cada bulto de 25kg preparado tiene un rendimiento de 17.000cm3 (17 litro).Tiempo de fraguado inicial (primera rigidización.) ocurre entre 2 y 3 horas.Máximo tamaño del grano: 1 mmFICHA TÉCNICA Densidad en polvo: 1350 0.5g/cc Retención agua: 97% Resistencia de compresión: 200Kg/cm2 Color: Blanco Cremoso Aspecto: polvo/granulometrí­a variada inferior a 3 mm._ Caracterí­sticas técnicas: AL2O3: 40,2%SiO2: 38,6%TiO2: 6,2%Fe2O3:2,4%MgO: 9,8%CaO: 1,2%Alcalis: 1,6%Enví­os:Formas de entregaEntrega a acordar con el vendedorUbicado en Tunja, Boyaca. _¿Cómo coordino el pago del enví­o?1. Al terminar tu compra, recibirás los datos del vendedor.2. Contáctalo para acordar el pago del enví­o.', 38000, 4, 144, 5, 5, 1, '528112068'),
