(133, 'Cama Abatible Multifuncional 90cm Ancho Maderkit M01310-prm', '123456789', 'Caracterí­sticas Principales:COLOR: CARAMELO-BLANCOMedidas: 208,5 cm Ancho x 211,4 cm Alto x 114,6 cm Fondo (vista horizontal)Atributos: Cama Sencilla Multifuncional, permite ocultar la cama cuando no se esta utilizando haciendo visible la repisa decorativa, cuenta con 8 compartimientos (4 con puertas). Un producto ideal para optimizar espacios. La cama sencilla soporta hasta 100 kg de peso y tiene capacidad para un colchón de 90 cm de ancho x 190 cm de largo, incluye tendido de tablas (No incluye colchón) Material: Fabricado en Madera Aglomerada (MDP) y Cubierta en Melamí­nico. Producto listo para armar (Requiere proceso de armado).Empaque: Empacado en 3 cajas que contienen: piezas en aglomerado, kit de herrajes, manual de armado y certificado de garantí­a.Observación: El proceso de armado lo realiza directamente el comprador y/o usuario del producto. Maderkit no se compromete con la prestación de este servicio. El precio no incluye ningún accesorio y/o elemento que no se describa en los atributos. La foto de este producto ha sido ambientada, el color presentado en la fotografí­a es una aproximación al color real. El video de este producto es una ilustración de la funcionalidad del mismo.Garantí­a: Nuestros muebles tienen Garantí­a de 5 AÑOS sobre las piezas de aglomerado y 1 AÑO sobre el kit de herrajesEntrega: Despachamos en máximo 3 dí­as hábiles después de concretada la compra. Entregamos en el transcurso de los 8 dí­as hábiles..Costo de enví­o: Si tu ciudad está en la imagen con listado de cobertura NO PAGAS ENVIO. Si la ciudad de destino no se encuentra en el listado te invitamos a consultar el valor de enví­o antes de generar la compra.Datos para enví­o: Requerimos de los siguientes datos a fin de tramitar la facturación y el despacho:- Número de cédula para facturación. (Si es empresa debe adjuntar copia del RUT)- Nombre completo- Número de teléfono fijo y/o celular- Correo e