(138, 'Tapa Control Xbox 360 Porta Pilas Portapilas Portabaterias', '123456789', 'EN ESTE MOMENTO, NO TENEMOS ENVIOS A LA REGION CARIBESOMOS TECHNO-VARIEDADESMILES DE VENTAS CON BUENA ATENCION, ENTREGAS A TIEMPOBUENA CALIDAD Y AL MEJOR PRECIOSOMOS TIENDAS FISICASENCUENTRAS NUESTROS PRODUCTOS A LOS MEJORES PRECIOS EN:https://listado.mercadolibre.com.co/_CustId_305772147Para que tengas una compra exitosa, recomendamos leer detalladamente las siguientes recomendaciones:1. Lee completamente la descripción del producto.2. Utiliza el portal de preguntas si tienes alguna duda, por allí­ te respondemos3. Revisa muy bien los términos y condiciones de garantí­a.4. Revisa muy bien que sea el producto que necesitas para evitar costosas y demoradas devoluciones.DESCRIPCION DEL PRODUCTOPRECIO POR UNIDADEl porta pilas del Control de Xbox 360 está elaborada con materiales de alta resistencia para que dure por mucho más tiempo y puedas divertirte jugando sin parar.PREGUNTAS FRECUENTES_¿debo tener actualizada mi direccion?Antes de la compra, la dirección de entrega debe estar actualizada y correcta (nosotros no podemos re-direccionar paquetes, hacer cambios en las guí­as de transporte o modificar los tiempos de entrega). Recuerda contar con tiempo y disponibilidad para recibir los enví­os._¿envios a todo el pais?Si, excepto, Region Caribe, San Andres y Leticia._¿cuando envian mi producto?Si realizas la compra antes de las 12:00 m del medio dia tu pedido se despachara el mismo dia, si efectúas la compra los dí­as Sábado o Domingo tu despacho saldrá hasta el dí­a Lunes._¿cuando llega mi producto?En la publicacion sale fecha de entrega, por lo general los tiempos de enví­o son de 1 a 2 dí­as hábiles en ciudades principales de a 5 a 6 en municipios ,veredas y las demás ciudades. Los tiempos de entrega NO SE PUEDEN GARANTIZAR debido a las condiciones de transporte y orden público._¿como puedo hacerle seguimiento a mi compra?El paquete es llevado a la oficina principal de la transportadora asignada por mercado libre. , de hay, la transportadora lo lleva a sus bodegas de distribucion y lo ingresan al sistema. A media noche entras a COMPRAS, VER DETALLE , DETALLE DE ENVIO,: hay te saldra la empresa trasnportadora asignada y \"CODIGO DE SEGUIMIENTO\" de tu compra._¿puedo enviar un Rapi o recoger el producto en Bogota?Este producto esta disponible solo para envio a nivel nacional a travez de mercado envios._¿Mi compra es 100% segura?Si, Mercado libre nos remite tu compra y luego de que el artí­culo sea entregado al cliente realiza el desembolso del dinero lo que asegura que tanto el comprador como el vendedor estén completamente protegidos._¿como pagar?:puedes pagar con mercado pago con: tarjeta de crédito (Dinners, Visa, Master Card, American Express, CODENSA) Efectivo (Efecty) Transferencia bancaria PSE y envios(servientrega)._¿esta disponible el producto?si esta activa la publicacion, es por que tenemos varias unidades a tu disposicion._¿cuanto demoraen entrar mi pago?Recuerda que la confirmación de tu pago es máximo 24 horas después de haber sido efectuado; por lo tanto los tiempos de entrega empiezan a contar a partir de la confirmación (los dií­as de entrega son dí­as hábiles)_¿como puedo pagar a cuotas?SOLO se puede pagar a cuotas con tarjeta de credito hasta 48 meses._¿hacen domicilios?si, envios a travez de mercado envios unicamente._¿me pueden enviar por otra empresa diferente a la que asigna mercado libre?no, envios solo por mercado libre a travez de mercado envios._¿se puede pagar a contraentrega?no, se paga SOLO por mercado pago_¿puedo saber su telefono o direccion?Por politica de mercado libre no podemos dar nuestros datos antes de comprar._¿cuanto vale el envio a mi ciudad?Si la publicacion no tiene envio gratis, le das comprar y te saldra el precio de envio a tu domicilio._¿en que horario atienden?atendemos en horario de oficina de lunes a viernes de 9:00 am a 5:00 pm. sabados y domingos no atendemos._¿que puedo hacer en caso de retracto?En caso de que ya no desee el producto recibido, puede realizar la devolución del mismo en un periodo no mayor a 5 dí­as, a partir de su entrega. Para ello, deberá pagar el costo del retorno hacia EE.UU. Este varí­a de acuerdo al tamaño y peso del producto._¿TIENEN ALGUNA GARANTÍA?Nuestros proveedores nos ofrecen una garantí­a de 15 dí­as la cual extendemos a nuestros clientes, esta cubre daños por defectos del material o errores en la fabricación. NO cubre mala manipulación por parte del usuario. si es un daño por parte del comprador se informara costo de reparación,*TODOS NUESTROS ARTÍCULOS TIENEN 15 DIAS DE GARANTIA!! PARA CONCEPTO DE GARANTÍA O RETRACTO, EL CLIENTE DEBE ASUMIR LOS COSTOS DE LOS ENVÍOS*', 2990, 1, 191, 5, 9, 1, '536087753'),
