(141, 'Arduino Uno R3 Chip Mega328p Smd Con Cable Usb', '123456789', 'SOMOS EMBTRONIK DISTRIBUIDORES DE BATERÍAS, COMPONENTES ELECTRÓNICOS Y DISEÑO DE PLACAS PCB.ENVÍOS A TODO EL PAÍS, Y SE ENTREGA DE 1 A 3 DÍAS A GRAN PARTE DE CIUDADES PRINCIPALES.Arduino Uno es una placa electronica basada en el microprocesador Atmega328. Lleva 14 entradas/salidas digitales y 6 de estas pueden utilizarse para salidas PWM.Además lleva 6 entradas analogicas, un oscilador de 16MHz, una conexión USB, un conector de alimentación, un header ICSP y un pulsador para el reset. La placa lleva todo lo necesario para soportar el microprocesador.Éste nuevo modelo Arduino UNO (rev3) es practicamente igual que su predecesor pero incorpora ésta vez una autoselección del voltaje de alimentacion (DC/USB) gracias a un chip MOSFET incluido en la placa. Además, dispone del nuevo bootloader OptiBoot que permite cargar programas a 115Kbps (56Kbps en la versión anterior).El bootloader también ha sido reducido en tamaño ya que tan sólo ocupa 512bytes, por lo que tendremos aún más espacio para programar.Especificaciones Arduino UNO (rev3):â€“ Microprocesador ATmega328â€“ Tensión operativa 5Vâ€“ Tensión de alimentación (recomendado) 7-12Vâ€“ Tensión de alimentación (limites) 6-20Vâ€“ 14 Entradas/Salidas Digitales (6 de estas se pueden utiliza para salidas PWM)â€“ 6 Entradas Analogicasâ€“ Maxima corriente continua para las entradas: 40 mAâ€“ Maxima corriente continua para los pins 3.3V: 50 mAâ€“ Flash Memory 32 KB (el bootloader usa 0.5 KB).â€“ SRAM 2 KBâ€“ EEPROM 1 KBâ€“ Velocidad del Clock 16 MHzâ€“ Para programar la placa es necesario un CABLE USB A USB TIPO B que viene incluido', 28500, 2, 192, 5, 9, 1, '538381210'),
