(144, 'Funda Forro Estuche 360 De Lujo + Vidirio 5d Xiaomi', '123456789', 'Por favor leer detalladamente las caracteristicas del producto y la información para el proceso de compra, esto le ayudará a tener una mejor experiencia de compra y que su producto llegue muy rapido.  _¡Hola! Somos Case Shop Colombia, te recomendamos leer detalladamente las caracterí­sticas del producto y la información para el proceso de compra.   CARACTERÍSTICAS - Carcasa 360 grados para mayor protección a su teléfono. - Material policarbonato PC (rí­gido) tipo 3 en 1 - Protección contra impactos elegante y lujosa. - Diseño delgado y muy liviano para mayor comodidad y excelente agarre. - Fácil y preciso acceso a botones. - Terminados con alto nivel de detalle.   Caracterí­sticas vidrio Cerámico:- Vidrio Cerámico se ajusta a la pantalla curva del telefono- Tiene pegante en toda la superficie del vidrio- Cubre la superficie de la pantalla hasta los bordes, por diseño queda un espacio entre el vidrio y la carcasa para evitar el roce y que se despegue el vidrio.- Excelente para proteger contra rayones, golpes, polvo etc- Alta resistencia a impactos y vibraciones.- Centrar muy bien el cerámico para evitar roce con la carcasa. Si no lo hace bien, afecta la compatibilidad con los estuches.- Los vidrios cerámicos son vidrios con condiciones especiales, NO TIENEN GARANTÍA POR INSTALACIÓN. Así­ que para la instalación es importante que lo realice alguien con mucha experiencia.- Los defectos mas comunes por instalación son: No centrar bien el vidrio, dejar burbujas de aire, no repasar bien los bordes para que pegue bien y despegarlo para volverlo a pegar- teniendo en cuenta los defectos anteriores la garantí­a por instalación solamente se da cuando se instala en nuestra tienda aliada. Recomendamos llevarlo a nuestra tienda aliada para la instalación.- Si desea un vidrio templado preguntar con un vidrio 5D full pegante o un 2D biselado.  PROCESO DE COMPRA:  Antes de la compra: - Si tiene dudas sobre los colores, por favor pregunte - Verifique muy bien las caracterí­sticas del producto, el tamaño o modelo que necesita. - Todas las preguntas son bienvenidas. - vea todas las fotos de la publicación, revise muy bien cada foto - En todas las publicaciones el sistema le muestra el costo del enví­o a la ciudad de destino, lo puede consultar antes de hacer la compra.   Durante la compra:  - Mercado libre tiene diferentes medios de pago: PSE, tarjeta debito, tarjeta crédito, Efecty entre otras, esto se puede consultar directamente en la pagina. - Verificar precio del producto y del enví­o. - verificar la dirección a la que el producto le va a llegar, si no esta bien o hay que hacer cambios, esto retrasa un poco el proceso - Dar click en comprar y seguir todos los pasos, luego verificar que se finalizó la compra, lo puede mirar en la pestaña de compras. - Verificar que hizo el pago del enví­o o que el enví­o esté incluido en la compar. Mercado enví­os utiliza Servientrega para llevar el producto a su domicilio. - Cuando selecciona a recoger donde el vendedor puede recoger el producto en las instalaciones del vendedor o se despacha el paquete a través de otras empresas de mensajerí­a.   Luego de la compra: - Luego de la compra, enviar al vendedor los detalles especí­ficos del producto que compró: (Color, forma, tamaño etc). Para esto debe ingresar a la pestaña contactar al vendedor - Enviar mensaje. Recuerde que por temas de trazabilidad la comunicación es por mercado libre - Cuando se realiza la compra y se definen los detalles del producto antes de medio dí­a, el paquete se enví­a el mismo dí­a. Si se realiza luego del medio dí­a, el paquete se enviará el dí­a hábil siguiente. - Sobre las 11 pm del dí­a del enví­o la plataforma se actualiza y le llega el número de guia para el seguimiento - Para obtener el número de guí­a debe ingresar a la pestaña detalles de la venta â€“ código de seguimiento. Este código es visible cuando la plataforma se actualiza. - El tiempo de llegada del paquete depende directamente de servientrega, para ciudades principales normalmente tarda 1-2 dí­as hábiles. Para algunas ciudades intermedias puede tardar un poco mas. - Si por algún motivo el paquete tarda en llegar, la primera recomendación es revisar el estado de su enví­o en la pagina de servientrega o llamar a la transportadora  Garantia del producto â€“ cambios - devoluciones  - Al recibir su paquete por favor verifique el estado del mismo. - Luego de abrir el paquete verifique el contenido del mismo, también verifique el estado del producto. Tome video del estado del producto. - Si evidencia algún defecto del producto, por ejemplo, llegó roto, rayado, dañado, sucio etc por favor comuní­quelo a la tienda, nosotros amablemente revisaremos el caso y le brindaremos la respectiva solución. - Si evidencia algún defecto del producto y lo comunicó a la tienda, NO DEBE USAR EL PRODUCTO O PARTE DE LA COMPRA. DEBE ESPERAR LA RESPUESTA. Si usted evidencia un defecto, pero lo usa, pierde la garantí­a - Queremos seguir siendo lí­deres en la página por nuestro servicio y nuestras calificaciones. Para esto tratamos de brindar el mejor servicio, si tienes alguna queja o reclamo no dudes en comunicarte con nosotros, estaremos atentos a brindar la respectiva solución de la manera mas oportuna.', 31990, 4, 67, 5, 9, 1, '539407373'),
(145, 'Luz Led Audio Rí­tmica Fiestas Discotecas Multicolor Rf 432', '123456789', 'Luz audio rí­tmica que es perfecta para toda clase de fiestas, discotecas, bares. Posee luces multicolores que se activan con el sonido o con el control de la parte trasera. Ahora podrás ambientar todas tus fiestas con este excelente producto. Caracterí­sticas_ Material: Carcasa en Plástico._ Tamaño producto: 15 x 19.5 x 17.5 cm._ Peso Aprox.: 419 g._ Funcionamiento: 110V / 50-60 Hz_ Consumo de energí­a: 30W_ Efectos estroboscópicos, rojo, verde y azul cambian a tres colores_ Controle la velocidad de rotación, los colores y la luz estroboscópica mediante el control en la parte trasera del producto._ Fuente de luz: 18 luces LED (6 rojas + 6 verdes + 6 azules)_ Estas luces son una perfecta opción para los DJ, discotecas, bares fiestas, entre otros._ Efectos estroboscópicos, rojo, verde y azul cambian a tres colores y velocidad de flash ajustable._ Canal de control DMX: 7 canales de control (favor ver manual de uso del producto)_ Sistema de audio DMX512 de 3 pines en la parte trasera de las luces._ Esta luz posee una larga vida útil, excelente estabilidad. Apariencia pequeña y liviana._ Diseño de doble asa, puede ayudar a soportar las luces en diferentes posiciones. _ El diseño de doble asa también sirve para plegar y poner sobre superficies planas.Contenido del Paquete_ 1 Luz led Discoteca multicolor._ 100 % Nueva.Por favor resuelva todas sus dudas antes de ofertar, esto facilitara nuestro trabajo y podrá recibir el producto tal y como lo desea. Estaremos siempre atentos a resolver sus inquietudes.', 79900, 1, 16, 5, 9, 1, '539658986'),
(146, 'Sensor Infrarrojo Arduino', '123456789', 'SOMOS EMBTRONIK DISTRIBUIDORES DE BATERÍAS, COMPONENTES ELECTRÓNICOS Y DISEÑO DE PLACAS PCB.ENVÍOS A TODO EL PAÍS, Y SE ENTREGA DE 1 A 3 DÍAS A GRAN PARTE DE CIUDADES PRINCIPALES.Un detector de obstáculos infrarrojo es un dispositivo que detecta la presencia de un objeto mediante la reflexión que produce en la luz. El uso de luz infrarroja (IR) es simplemente para que esta no sea visible para los humanos.Constitutivamente son sensores sencillos. Se dispone de un LED emisor de luz infrarroja y de un fotodiodo (tipo BPV10NF o similar) que recibe la luz reflejada por un posible obstáculo.El montaje es sencillo. Alimentamos el módulo a través de Vcc y GND conectándolos, respectivamente, a la salida de 5V y GND en Arduino.Finalmente, conectamos la salida digital del sensor a una entrada digital para leer el estado del sensor.Voltaje: 5 VoltsPines: 3', 5000, 1, 120, 5, 9, 1, '539988528'),
