(156, 'Modulo Gps Neo 6m Ublox Arduino ', '123456789', 'SOMOS EMBTRONIK DISTRIBUIDORES DE BATERÍAS, COMPONENTES ELECTRÓNICOS Y DISEÑO DE PLACAS PCB.ENVÍOS A TODO EL PAÍS, Y SE ENTREGA DE 1 A 3 DÍAS A GRAN PARTE DE CIUDADES PRINCIPALES.INFO:Módulo GPS basado en u-blox NEO-6M con eeprom incluido, incluye antena. Es compatible con varios controladores de vuelo que necesitan de posicionamiento GPS.ESPECIFICACIONES TÉCNICAS:Voltaje de alimentación: 3-5 VDCInterface: Serial UART 5VAntena cerámicaEEPROM para guardar datos de configuración cuando el módulo se desenergiceBaterí­a de respaldo (MS621FE)Frecuencia de refresco: 5HzSoporta SBAS (WAAS, EGNOS, MSAS, GAGAN)Indicador de señal con LEDTamaño de la antena: 25mm x 25mmTamáño del módulo: 25mm x 35mmTamaño de los agujeros de montaje: 3mmBaud rate por defecto: 9600bpsPara situaciones donde se necesita una mayor precisión para la navegación irregular, velocidades rápidas, o rutas complejas, NEO-6M es perfectoLos resultados indican que el módulo GPS NEO-6M supera a la de servicio de localización GPS del iPhone en casi todos los casosEl NEO-6M tiene una antena muy grande, por lo que la precisión de la localización GPS es mucho mejorNEO-6M es capaz de proporcionar actualizaciones de mayor resolución, mejores aproximaciones de ubicación, y las lecturas más consistentes************** TENEMOS PARA ENTREGA INMEDIATA ************', 29000, 2, 7, 5, 9, 1, '544162326'),
