(160, 'Ddj-400 Controlador Para Pioneer Dj Ddj 400 Ddj400 ', '123456789', 'AKITA MUSIC DISTRIBUIDOR AUTORIZADO PIONEER DJ Y MERCADOLIDER OFRECE PARA USTEDES PARA ENTREGA O DESPACHO INMEDIATO:Controlador DJ para PIONEER DDJ-400EN AKITA MUSIC MANEJAMOS FACTURACIÓN LEGAL CON IVA Y GARANTIA DIRECTA / ENVIOS A NIVEL NACIONAL.Caracterí­sticas: _ Dos canales._ 1 entrada de micrófono jack de 1/4._ 1 Salida de audí­fonos por jack de 1/8._ Pads de goma._¿_ 1 salida estéreo rca._ Incluye rekordbox._ Dimensiones(w x d x h)= 482 x 272,4 x 58.5 mm._ Peso: 2.1 kg.POR LO GENERAL LLEGA EN 1 O 2 DIAS HABILES PERO PUEDE TARDAR HASTA 5 DIAS HABILES DEPENDIENDO DEL LUGAR DE DESPACHO Y LA DISPONIBILIDAD EN BODEGAS.EN AKITA MUSIC MANEJAMOS FACTURACIÓN LEGAL CON IVA Y GARANTIA DIRECTA / ENVIOS A NIVEL NACIONAL.', 1165000, 4, 64, 5, 9, 1, '549583333'),
(161, 'Filtro Purificador De Agua A Base De Ozono + 2 Regalos', '123456789', 'PROMOCION DE PURIFICADORES DE AGUA DE GRAN CALIDAD EN ACRILICO + OBSEQUIOS, LLAVE DE SERVICIO Y ENVIO GRATIS + ESQUEMA DE INSTALACION + VIDEO TUTORIAL Y ASESORIA TELEFONICA SI ES NECESARIO.SISTEMA DE PURIFICACION DE AGUA COMPLETO A BASE DE OZONO.SOMOS FABRICANTES CON GRAN TRAYECTORIA EN EL MERCADO COLOMBIANO. Nuestro equipo Biofilters de tratamiento de agua a base de ozono, consta de dos etapas para una efectiva purificación del agua.Una primera etapa de micro filtracion que retiene sedimentacion, color, olor, sabor, y el cloro del agua.El agua del acueducto pasa a través un filtro de 10 micras elaborado 100% de carbón activado de alta calidad, junto con una membrana de polideth para una mayor absorción de sedimentos y otros agentes presentes en el agua,elaborado con materiales originales.Una segunda etapa bactericida a base de ozono, luego de ser filtrada el agua,pasa por un avanzado sistema electrónico para la generación de ozono a partir del oxigeno ambiental, el ozono que se produce es conducido por una cámara donde se lleva a cabo la ozonización del agua por contacto, eliminando todo tipo de bacterias hongos y demás microorganismos presentes en el agua para una completa esterilización, apta para el consumo humano.BENEFICIOS DE BEBER AGUA FILTRADA Y OZONIZADA- Ayuda a eliminar las toxinas del organismo- Tonifica las paredes estomacales- Su poder desinfectante genera ventajas en la conservación de los alimentos- Elimina todo tipo de hongos que se encuentran en los alimentos sin alterar sus propiedades- Es excelente para la prevención de caries dentales, cálculos renales.- Facilita la cicatrización de pequeñas heridas.- Elimina malos olores causados por el cigarrillo y el alcohol, oxigenando el organismo y desintoxicándolo, eliminando  así­ el malestar generado.- El consumo de agua ozonizada en niños evita enfermedades del sistema digestivo, evitando cólicos, diarreas y  amibiasis.- Ideal para bañarse la cara en las mañanas y en las nochesVENTAJAS - Retiene grandes cantidades de partí­culas suspendidas en el agua mayores a 5 mí­crones.- Reduce agentes quimicos como el cloro, restos de pesticidas, herbicidas y otras fuentes de contaminates orgánicos  que afectan el sabor y el olor del agua.- Larga vida útil , el eqipo esta elaborado en materiales duraderos y de gran calidad- El sistema requiere mantenimiento minimo- fácil de instalarECONOMÍA Por costos y por salud no es recomendable la constante compra de botellones de agua ya que estudios cientificos avalan que estos desprenden quí­micos nocivos para nuestra salud, y tendrí­amos que comprar uno aproximadamente cada 4 dí­as, afectando la economí­a.GARANTIA1 año por defectos de fabrica.CARACTERISTICAS- CAPACIDAD: 180 Litros/ H- VOLTAJE: 110 V- CONSUMO: 25 W- PRESIÓN MÍN 8 PSI- PRESIÓN MÁX 60 PSICONTENIDO- 1 EQUIPO GENERADOR DE OZONO- 1 KÍT DE INSTALACIÓN. - 1 CARCASA 7 PULGADAS- 1 FILTRO GRANULADO CARBÓN ACTIVADO 7\"- 2 METROS DE MANGUERA PARA INSTALCION- ESQUEMA DE INSTALACIÓNOBSEQUIOS- 1 LLAVE DE SERVICIO- ENVIO GRATIS', 126990, 1, 66, 5, 8, 1, '550697742'),
