(163, 'Escalera Tipo Ii Tijera Dieléctrica 7 Peldaños / 2.10 Metros', '123456789', 'ESCALERAS TIPO TIJERA EN FIBRA DE VIDRIO COMERCIAL\n\nCERTIFICACIONES, CALIDAD, GARANTÍA, REPUESTOS, Y MANTENIMIENTO LOCAL \n\nMARCA: ESCALERAS DE COLOMBIA\n\nTIPO COMERCIAL: ESCALERA DE TIJERA EN FIBRA DE VIDRIO FUERTE, LIVIANA Y AISLADA. TIPO COMERCIAL, 250 LIBRAS, O 114 KILOGRAMOS, DE CAPACIDAD DE CARGA, USO ELÉCTRICO, CUMPLEN LA NORMA ANSI 14.5, PELDAÑOS PLANOS EN ALUMINIO RANURADO, PLATAFORMA DE PLÁSTICO. ZAPATAS ANTIDESLIZANTES DE ALUMINIO EXTRUIDO Y CAUCHO, GARANTÍA DE UN AÑO, REPUESTOS Y SERVICIO LOCAL\n\nFICHA TECHNICA: PERFILES ó Rieles Pultruidos: Son fabricados con resinade poliestireno, reforzados con Fibra de Vidrio, con inhibidor de rayos ultravioleta, para retardar el fenómeno de envejecimiento por la exposición solar, son livianos, más resistentes, con un alto nivel de aislamiento, gran resistencia mecánica y uniformidad en las caracterí­sticas eléctricas y mecánicas; nuestro proveedor es la Strongwell, de Estados Unidos, ellos tienen patentado este material como EXTREN 525 especí­ficamente para la fabricación de perfiles para escaleras de uso eléctrico y también de tubos para pértigas.Es un material especí­ficamente adecuado para uso eléctrico a intemperie. La Strongwell provee de tubos y perfiles a casi todos los fabricantes de Pértigas y Escaleras en Fibra de Vidrio de los Estados Unidos. Como son la Hasting, AB Change, Werner, Stanley, Louiville, y muchos otros. BISAGRAS en acero galvanizado. PLATAFORMA de Plástico ABS de alto impacto, muchí­simo más fuertes, gruesos y robustos que los usuales de otros fabricantes. PELDAÑOS de duraluminio fuertes y livianos, con un labrado o estrí­as profundas muy especial y diferente, que garantiza una mejor adherencia a la suela de los zapatos del operario. REMACHES más fuertes y durables. Peso, medidas y caracterí­sticas homologadas a los Estándares y Normas Internacionales. CAPACIDAD DE CARGA: Tipo Comercial con capacidad de carga de 250 Libras o 114 Kilogramos.\n\nCALIDAD Nuestras escaleras cumplen con las normas internacionales, especí­ficamente con la Norma ANSI A 14.5 y EN-131 que regula la fabricación de las escaleras en Fibra de Vidrio.Certificación Nacional del Laboratorio de la Empresa de Teléfonos de Bogotá y de Ecopetrol Dpto. Calidad,también del Laboratorio de Pruebas de la Universidad de Panamá. Todas estas en nuestro poder, Veintidós años Experiencia. GARANTIA, Repuestos y Servicios Locales.\n\nNota: Nuestras escaleras no tienen Bandeja \n\nOPCIONALES: PLATAFORMA DE ALUMINIO, DOBLE SUBIDA, Y RUEDAS\n\n\n\n \n\nNota: Nuestras escaleras no tienen Bandeja\n\nADICIONALES\nOpcionales Pasamanos, y Ruedas', 329800, 3, 178, 5, 5, 1, '552243832'),
(164, 'Comoda 4 Cajones Com5628', '123456789', 'Cómoda Marca INVAL, Referencia COM 5628 Medidas: Altura 96 cm, Ancho 80 cm y Profundidad 37,5 cm.Atributos: Mueble fácil de armar, se requiere de herramienta básica para el ensamble.Material: Fabricado en Madera Aglomerada (MDP) y Cubierta en Melamí­nico.Costo de enví­o: El envió es gratis a las ciudades que se encuentran en las últimas imágenes de la publicación, si tu cuidad no se encuentra en este listado, pregúntanos para mayor información. Empaque: Empacado en 1 caja que contiene: piezas en aglomerado con sus respectivas perforaciones, kit de herrajes, manual de armado y certificado de garantí­a. Entrega: La entrega es de 3 a 5 dí­as hábiles después de la compra.Observación: No incluye elementos decorativos, la foto de este producto es ambientada, el color presentado en la fotografí­a es una aproximación al color real. Garantí­a: Nuestros muebles tienen garantí­a de 5 AÑOS en las piezas de aglomerado y 1 AÑO sobre los accesorios, el mueble contiene el certificado de garantí­a donde especifica las condiciones del buen uso.', 289900, 1, 243, 5, 5, 1, '552607649'),
(165, 'Baterí­a Ollas En Granito 8 Piezas Schaffhausen Black Gold', '123456789', 'Schaffhausen es una marca creada en Suiza con el objetivo de ofrecerle a sus clientes concepto y diseño en los productos de cocina, enfocándose en artí­culos que sean cómodos, fáciles de usar y duraderos, caminando siempre a la vanguardia de la innovación, distinguiéndose por su calidad en el mercado mundial.CARACTERÍSTICAS PRINCIPALES Revestimiento en eco granito. Saludable, natural y de alta calidad granito. Fondo grueso para ahorro de calor y energí­a. Se pueden meter al lavaplatos.Edición de lujo. Cuerpo exterior durable. 8 Piezas. Fácil de limpiar. Aptas para estufas de inducción, eléctrica y gas. CONTENIDO 1 Olla con tapa de vidrio con silicona de 20 cm 1 Olla con tapa de vidrio con silicona de 24 cm 1 Olla con tapa de vidrio con silicona de 16 cm 1 Sartén de 24 cm 1 Refractaria Rectangular', 399900, 1, 48, 5, 5, 1, '553758668'),
(166, 'Tapa Asiento Alongado Para Sanitario Caí­da Lenta, Blanca', '123456789', 'Tapa alongada de caí­da lenta, especial para los sanitarios modernos, el cierre de esta tapa asiento es lento y no golpea la porcelana sanitaria. Herrajes graduables para su instalación.Sistema: Caí­da lenta.Acabado: Blanco Medida: 47 Cms Alta, Aproximadamente Material: ABS industrial.Instalación: hazlo tú mismo. Contenido de la caja: asiento sanitario, Herraje de instalación._______________________________________________________________________¿Generan factura legal?Si. Generamos facturas legales con IVA incluido. Somos régimen común._¿Son importadores Si, somos importadores oficiales. ¿Mi compra tiene garantí­a?Si. Todos nuestros productos son nuevos y cuentan con garantí­a oficial. Se entregan en sus empaques o cajas originales. ¿Tiene bodega propia? En PAMO sabemos la importancia de recibir tu producto a tiempo, por eso contamos con bodega propia e inventario actualizado al instante, para que podamos gestionar tu pedido y despacharlo lo antes posible.Si estas en Bogotá podemos entregarte el mismo dí­a: Puedes recoger en nuestra bodega. Podemos enviar un servicio de envió express a tu domicilio, que en 1 o 3 horas deja el paquete en tu hogar. Este servicio tiene un valor muy económico extra liquidado en el momento de la compra.', 99700, 4, 213, 5, 5, 1, '554270064'),
(167, 'Jabón Liquido Para Manos Elemental - mL a $60', '123456789', 'Fórmula suave con un olor a Verbena, agradable y biodegradable. Con agentes limpiadores y acondicionadores que no resecan la piel. Libre de fosfatos y sal, incluye un componente antiséptico orgánico que limpia y elimina microorganismos a la vez.Modo de uso: Aplica directamente sobre las manos pre humedecidas, deja actuar durante al menos 20 segundos. Después enjuaga con abundante agua.', 29900, 1, 37, 5, 8, 1, '554524621'),
