(169, 'Kinect Xbox 360 Sensor Kinect (Reacondicionado)', '123456789', 'Kinect es un dispositivo de juego (para Xbox 360) mediante el cual puedes jugar con todo el cuerpo, es decir, sin mandos. Kinect también reconoce gestos, comandos de voz, objetos e imágenes. También, es capaz de modelar nuestro avatar a nuestra imagen y semejanza y entablar conversaciones con hasta 8 avatares diferentes en escenarios virtuales gracias a la aplicación Kinect Avatar que usa la tecnologí­a de reconocimiento de Kinect y de esta forma los gestos que hacemos con la cabeza y boca se trasladan a la conversación virtual.', 89999, 4, 190, 5, 9, 1, '555806379'),
(170, 'Puerta Plegable En Pvc', '123456789', 'Puerta plegable en pvc alto 2.40 ancho 0.95cm se fabrica a la medida que necesite variedad de colores', 285000, 1, 33, 5, 5, 1, '556787994'),
(171, 'Soporte Resistente Al Calor De Silicona Ollas Horno Press', '123456789', '77230 - SOPORTE RESISTENTE AL CALOR DE SILICONA Disponibilidad en color FUCSIA Fabricado en silicona de alta flexibilidad. Resisten temperaturas hasta 220 Grados Centí­grados. Ideal para colocar sartenes y moldes calientes.Materiales:Silicona Uso:Ideal para colocar recipientes calientes Cuidados. Antes de utilizar lavar con agua y secar inmediatamente.No colocar directamente al fuego o electricidad. Resiste temperaturas máximas de 230°C. Contenido: 1 Pieza. SOMOS TIENDA OFICIAL EN MERCADOLIBRE 100% de nuestros compradores nos recomiendan.', 14900, 2, 24, 5, 5, 1, '557230867'),
(173, 'Máquina De Afeitar De Seguridad Con Soporte Baili', '123456789', 'Máquina de afeitar de doble filo, plateada. Viene empacada en una caja de regalo que contiene: 1 maquina de afeitar, 1 base, 1 contenedor de cuchillas y 5 cuchillas. Su sistema de cabeza y apertura de mariposa es seguro y previene los cortes. Fabricada en Zinc premium, con un excelente cromado.Hermoso diseño moderno/retro.Peso: 89 gr. Medidas: 12 cms. de alto. Nota: el precio del producto no incluye enví­o.', 93000, 2, 115, 5, 8, 1, '557258980'),
