(179, 'Módulo Elevador De Voltaje Mt3608 Dc-dc - Step-up', '123456789', 'SOMOS EMBTRONIK DISTRIBUIDORES DE BATERíAS, COMPONENTES Electrónicos Y DISEÑO DE PLACAS PCB. Envíos A TODO EL PAíS, Y SE ENTREGA DE 1 A 3 Días A GRAN PARTE DE CIUDADES PRINCIPALES. DESCRIPCIÓN El convertidor de voltaje DC-DC Step-Up 2A MT3608 tiene como función entregar un voltaje de salida constante superior al voltaje de entrada frente a variaciones del voltaje de entrada o de carga. Soporta corrientes de salida de hasta 2A (máximo no recomendado), voltaje de entrada entre 2V a 24V y voltaje de salida entre 2V a 28V. El voltaje de salida se selecciona mediante un potenciómetro multivuelta.El convertidor DC-DC MT3608 es un regulador de tipo conmutado elevador (Step-Up o Boost) con una alta eficiencia de conversión, excelente regulación de lí­nea y bajo voltaje de rizado.  El módulo reduce al mí­nimo el uso de componentes externos para simplificar el diseño de fuentes de alimentación. Permite obtener un voltaje regulado a partir de una fuente con un voltaje inferior, por ejemplo: obtener 5V o 12V a partir de una baterí­a de litio de 3.7V. Es capaz de manejar una carga de hasta 2A (máximo no recomendado) o 6W máx.Caracterí­sticasConvertidor DC-DC Boost: MT3608Voltaje de entrada: 2V a 24V DC Voltaje de salida: 5V a 28V DCV. Salida ajustable (Regulable por trimmer)Corriente de salida: máx. 2A (usar disipador para corrientes mayores a 1.2A)Potencia de salida: 6WEficiencia de conversión: 93% máx.Frecuencia de Trabajo: 1.2MHzProtección de sobre-temperatura: SI (apaga la salida)Protección de corto circuito: NO Protección limitadora de corriente: SI (4A)Protección frente a inversión de polaridad: NO Dimensiones: 36mm*17mm*7mm', 5000, 3, 201, 5, 9, 1, '561406135'),
