ar cualquier inconveniente que tengas directamente la mensajerí­a y con gusto te ayudaremos a resolver cualquier inquietud o inconveniente.  _»_»  Si desean una Declaración de Importación deben comunicarse luego de la compra por la mensajerí­a. CUALQUIER OTRA DUDA, ESTAMOS A TU DISPOSICIÓN!! Hacen Factura? Sí­, hacemos factura. La misma se genera de forma automática a partir de los datos que cargas al momento de completar el checkout de tu compra, estos pueden ser a nombre de una persona fí­sica o empresa. Te pedimos que cargues la documentación correspondiente al efectuar la compra, en la sección \"Completa los datos para tu factura\".', 199900, 2, 148, 5, 10, 1, '561640835'),
