(248, 'Set De 4 Llantas Firestone 195/60 R14 Firehawk 900 ', '123456789', 'Referencia: 195/60 R14 FIREHAWK 900 Firestone                                 Índice de carga: 86-530 Kg (Máx Carga Kg)                              Índice de velocidad: H-210 Km/h (Velocidad Máx Km/h)                            Procedencia: México.Firestone Firehawk 900 es una llanta con diseño direccional y aspecto deportivo. Diseñado para brindar un excelente agarre y durabilidad; además ofrece un gran desempeño sobre superficies secas y mojadas.Caracteristicas: 1.Diseño Direccional Con Grandes Bloques En Hombros.2.Mejor respuesta en mojado.Beneficios: 1.Incrementa la respuesta de frenado.2.Mayor agarre en curvas. ::: :::: Muchas gracias por tomarte el tiempo para mirar nuestra publicación :) , Busca Llantas es una empresa con mas de 6 años de experiencia en llantas para Automovil , Camioneta y Camion.  ::: :::::Somos distribuidores autorizados de las marcas Goodyear, Pirelli, Bridgestone, Kumho, Maxxis, Black Lion y muchas más . :::::IMPORTANTE:: Por favor siempre preguntar disponibilidad :::::IMPORTANTE:: La publicación no incluye rin. :::::IMPORTANTE:: Imágenes de referencia preguntar cualquier duda que tengas.  ::: :::::IMPORTANTE:: El despacho de su pedido se realizara al siguiente día hábil después de la compra.  ::: :::: Envíos Gratis a los diferentes destinos que cubra Envia y Servientrega ,100% Confiables con Mercado Envíos (Es el servicio de Mercado Libre que te permite recibir tus productos de forma rápida y segura).  ::: :::: Medios de pago (Mercado Pago): TARJETAS DE CREDITO: VISA, American Express, Mastercard ,Diners Club y Condensa . EFECTIVO EN PUNTOS DE PAGO: Pagas con Efecty , y se acredita instantáneamente . Con Davivienda se acredita de 1 a 2 dias .TRANSFERENCIA D  ::: :::: Para nosotros es importante que nos preguntes todas las inquietudes que tengas sobre el producto , para que este cumpla con tus requerimientos', 1160900, 4, 42, 5, 3, 1, '546665584');
