(249, 'Intercomunicador T-com 100 Metros Con Todos Los Accesorios', '123456789', 'Intercomunicador (ref. T-com 100 mts -bluetooth 4.1-freed-conn)IMPORTANTE EL SOPORTE ES UN OBSEQUIO POR LO TANTO NO TIENE CAMBIO SOLO CONTAMOS CON ESA TALLA El intercomunicador para los motociclistas moto es la mejor opción para dar comodidad para conducir, contestar el teléfono, escuchar música de una manera más segura, sin comprometer la integridad tuya y de su acompañante. El intercomunicador para moto T-COM 100 MTS, es ideal para los motociclistas que quieren estar comunicados sin poner en riesgo su seguridad ni la de su acompañante,  Con el sistema de Bluetooth, permite vincularse con su celular donde podrá recibir llamadas, realizar la ultima llamada realizada.Escuchar radio FMPosibilidad de conectar en conferencia dos dispositivos intercomunicadores (no tienen que ser los misma marca porque son de Bluetooth® universal de banda abierta)Posibilidad de conectar hasta tres intercomunicadores en cadena (1 con 2, 1 con 3 y viceversa).Batería de litio recargable.Sonido EstéreoMando de perilla de fácil manipulación hacia arriba y hacia abajo, permitiendo una comodidad al motociclista y su acompañanteEl intercomunicador es 100% impermeable y resiste las lluvias.Para dar seguridad, confianza a nuestros clientes ofrecemos un año de garantía.Especificaciones:-Comunicación entre motos.-Conexión con MP3 y GPS.-Batería litio recargable.-100% de Impermeabilidad.-Radio FM Incorporado.-Conexión entre motos hasta 100 Mts de distancia.-Recepción y discado de llamadas.-Garantía de un año en el intercomunicador, tres meses en los accesorios', 189900, 4, 82, 5, 3, 1, '551124611'),
(250, 'Set De 4 Llantas Roadmarch 185/55 R14 Primestar 66', '123456789', 'Referencia: 185/55 R14 Primestar 66 Roadmarch      Indice de Carga: 80-450Kg(Máx Carga Kg)           Indice de Velocidad: H-210Km/h(Velocidad Máx Km/h)           Procedencia: China::: El nuevo compuesto de la banda de rodadura que contiene silicio mejora el agarre en condiciones de carretera mojada y reduce la resistencia a la rodadura, proporciona una conducción segura y reduce el consumo de combustible.  ::: Diseño de patrón de \\\"línea recta\\\". El diseño estereoscópico de patrón de \\\"línea recta\\\" absorbe los temblores de la carretera y proporciona una conducción más cómoda.  ::: El diseño de los pasos de la banda de rodadura simulados por computadora reduce la resonancia de la conducción con una excelente conducción silenciosa y cómoda. :::: Muchas gracias por tomarte el tiempo para mirar nuestra publicación :), Busca Llantas es una empresa con más de 6 años de experiencia en llantas para Automóvil, Camioneta y Camión.:::::Somos distribuidores autorizados de las marcas Goodyear, Pirelli, Bridgestone, Kumho, Maxxis, Black Lion y muchas más.:::::IMPORTANTE:: Por favor siempre preguntar disponibilidad:::::IMPORTANTE:: La publicación no incluye rin. :::::IMPORTANTE:: Imágenes de referencia preguntar cualquier duda que tengas.:::::IMPORTANTE:: El despacho de su pedido se realizara al siguiente día hábil después de la compra.:::: Envíos Gratis a los diferentes destinos que cubra Envia y Servientrega ,100% Confiables con Mercado Envíos (Es el servicio de Mercado Libre que te permite recibir tus productos de forma rápida y segura).:::: Medios de pago (Mercado Pago): TARJETAS DE CREDITO: VISA, American Express, MasterCard, Diners Club y Condensa. EFECTIVO EN PUNTOS DE PAGO: Pagas con Efecty, y se acredita instantáneamente. Con Davivienda se acredita de 1 a 2 días. TRANSFERENCIA D:::: Para nosotros es importante que nos preguntes todas las inquietudes que tengas sobre el producto, para que este cumpla con tus requerimientos', 700900, 4, 19, 5, 3, 1, '554088807'),
