(256, 'Kayak Inflable Excursión Pro  384x94x46 Cm Intex 68309', '123456789', 'Kayak inflable INTEX para 2 personas, soporta un peso máximo de 180 kg y sus dimensiones son 384 cm largo x 94 cm ancho x 46 cm altoCon 2 quillas (1 direccional), 2 soportes para caña de pesca, 2 asientos inflables, 2 reposapiés, 2 asas y cuerdas de sujeción y espacio de almacenajeFabricado con 3 capas de vinilo resistente y galga de 0,75 mm, diseño con gráficos deportivosIncluye inflador manual, 2 remos dobles de aluminio de 218 cm, manómetro y bolsa de transporteEl kayak inflable cumple con la normativa europea estándar ISO 6185-1 y la certificación TÜV GSNavega y pesca en lagos, ríos o en el mar con el nuevo Kayak inflable INTEX K2 Excursion Pro. Este nuevo modelo está fabricado con el sistema Super-Tough INTEX: materiales de alto impacto y lona de triple capa y grosor de 0,75 mm resistente a roces para ofrecer la máxima durabilidad. En un llamativo color naranja y gráficos deportivos, el Excursion Pro incluye todo lo que necesitas para iniciarte en la práctica de esta embarcación de recreo. Su interior está preparado para su uso por una o dos personas con suelo y 2 asientos inflables de base y respaldo acanalados y un cojín extra que te permite elevar uno de los asientos. También cuenta con reposapiés regulables y un soporte metálico para colocar una caña de pescar o un dispositivo GPS.Para manejar el kayak se incluyen 2 remos de aluminio de 218 cm con pala acanalada, además de dos quillas, una fija y otra direccional, que puedes cambiar en función del lugar en el que vayas a utilizar la embarcación. Si lo utilizas para salir de pesca, el kayak dispone de 2 soportes para caña de pescar y zona de almacenaje en proa y popa con anillas soldadas a la lona para sujetar las bolsas (bolsas no incluidas). En ambos extremos el kayak cuenta con cuerdas y asas de sujeción soldadas a la lona con las que te será muy fácil transportarlo para entrar o salir del agua. Además, los topes del kayak están reforzados ante posibles roces.Preparar el Excursion Pro para salir a navegar te costará muy poco esfuerzo gracias al inflador manual INTEX incluido. Para un llenado óptimo, el kayak dispone de manómetro con el que te asegurarás de inflarlo con la presión indicada. El inflador también facilita el proceso de desinflado y plegado al extraer todo el aire del interior del kayak y hace que doblarlo sea mucho más fácil y ocupe menos espacio. También incluye una práctica bolsa para su transporte y almacenaje. La estructura de este modelo cuenta con 3 cámaras de aire independientes con válvulas de doble sistema de seguridad que aseguran la flotabilidad del kayak Si, durante el uso, entra agua en agua al kayak, utiliza el tapón de desagüe para vaciarlo de forma fácil y rápida sin tener que moverlo.Como el resto de las embarcaciones INTEX, el Kayak inflable Excursion Pro cumple con la normativa europea estándar ISO 6185-1 y la certificación TÜV GS. ¡Disfruta del deporte acuático más trepidante con las barcas y kayaks inflables INTEX!POLITICAS DE GARANTIA INTEX LOS INFLABLES QUE NO TENGAN PARTES ELECTRICAS COMO FLOTADORES, ALMOHADAS, COLCHONES SENCILLOS Y DE CAMPING: LONA 30 DIAS POR DAÑOS DE FABRICACION (PLIEGUES O COSTURAS ABIERTAS) LOS COLCHONES ELECTRICOS (MOTOR) 1 AÑO Y LA LONA 30 DIAS (POR PLIEGUES O COSTURAS ABIERTAS) PISCINAS ESTRUCTURALES Y DE FACIL ENSAMBLE: LONAS 90 DIAS Y SISTEMA ELECTRICO (MOTOR) 1 AÑO La garantía limitada no se aplica si el producto ha sufrido uso u operaciones indebidas, accidentes o tuvo un almacenaje deficiente. Tampoco en caso de pinchazos, rajas, abrasión, deterioro o daños causados por exposición al fuego, frio extremo, lluvia u otras causas naturales. No cubre en el caso donde el artículo haya sido reparado o desmontado por personas ajenas al centro de servicios autorizado. • Debe de tener el producto con todas sus piezas originales. • Debe de informar las causas por las cuales realiza la reclamación de la garantía. En caso de que sea por