(268, 'Guayacán Amarillo Semilla Especial Para Maceta Bonsai K651', '123456789', 'Semillas de Guayacán amarillo. Semillas muy especiales para aprovechar espacios reducidos y decorar. TECNOKREAR: Estas semillas son muy particulares ya que se pueden usar para producir Guayacanes amarillos destinados a decorar ambientes de 3 maneras espectaculares: 1) para embellecer un sitio con un espectacular árbol de Guayacán amarillo en tamaño mini, como bonsái, de unos 60 a 80 cm de altura ; 2) para adornar un espacio pequeño como el balcón de un apartamento, un pasillo o en un jardín con un espectacular árbol de Guayacán amarillo de unos 120 a 180 cm de altura en una maceta grande especial; 3) también lo puedes sembrarlo directamente en el suelo de un patio, jardín y usarlo en tamaño grande que te sirve como decoración del ambiente, jardín, la entrada de la casa, edificio e igualmente al ser de gran tamaño, te servirá de sombreo y te producirá un agradable olor que funcionara como ambientador natural.BENEFICIOS Y USOS1) 3 adaptaciones para producción o embellecimiento y decoración del medio ambiente.a) Como bonsái de un tamaño mini para adorno de cualquier entorno b) En matera para adorno de pasillos, balcones o huerto.c) De gran tamaño para sombra y adorno de jardín y entrada de casa, edificio, edificaciones o parques.2) Protección de la radiación solar. 3) Purificación del aire.4) Relajante y des estresante al concentrarse en el crecimiento, progresos y cuidados.5) Agradable olor que sirve como ambientador natural en cualquier espacio.CON LA COMPRA RECIBES200 semillas de Guayacán amarillo+ 190 semillas de regalo50 semillas de guayaba dulce para maceta, bonsái o suelo20 semillas de pino ciprés para maceta, bonsái o suelo20 semillas de tomate chonto20 semillas de cilantro30 semillas de zanahoria20 semillas del col tallos30 semillas de perejilReferencia de semilla: K651Tipo de semilla: Variedad mejoradaTiempo de germinación: 10-15 díasPara la germanización, la temperatura debe ser de :18-30 grados centígradosEmpaque: Sobre protegido con espumaVIDEOS TUTORIALES GRATIS1) - Como germinar la semilla de Guayacán amarillo2) - Cuidados básicos del Guayacán amarillo3) - Como plantar y mantener una planta en matera4) - Como hacer de una plata un bonsái. técnicas básicas5) - Manual básico de germinación y sembrado de semillas de regalo adicionales6) - Acceso a Grupo facebook Ideas y productos para tu jardínPAGO Y ENVÍOPAGO:Pago con seguro de protección al comprador por medio de MercadoPagoENVÍO: A toda Colombia.GUAYACÁN AMARILLO: Es un árbol que alcanza hasta 5 m de alto o más; el tronco puede llegar a tener un diámetros de hasta 60 cm, es caducifolio (que pierde las hojas en condiciones de sequía), ramas escasas gruesas y ascendentes; fuste recto. La corteza es áspera de color gris a café oscuro, tiene grietas verticales, profundas y forman placas anchas de color café oscuro. Hojas opuestas, con 5 hojuelas, de 5 a 25 cm de largo y de 8 a 20 cm de ancho. Sus flores campanuladas (forma de campana), grandes, en grupos de inflorescencias, de 5 a 12 cm de largo, de color amarillo claro, muy vistosas con líneas rojas en el cuello. Los frutos son cápsulas cilíndricas, angostas, de 11 a 35 cm de largo y 0,6 a 2 cm de ancho, dehiscentes (que se abre espontáneamente a la madurez). Semillas aladas, aplanadas, de 1,5 a 2 cm de largo y 1 cm de ancho, de color gris plateado. Árboles de Centroamérica.', 19950, 5, 99, 5, 8, 1, '562863618'),
