(287, 'Mancuernas Pesas 40kg 80lb Antideslizante Termoforradas Barr', '123456789', 'Home Sale traen para ti esta espectacular Set de Mancuernas de 40 KG/80LB , ahora realizar tu rutina de ejercicio será más fácil, ya que cuentas con una de las mejores Set de Mancuernas calidad/precio. El entrenamiento con pesas es uno de los deportes de fuerza más eficaces y es también muy bueno en el área de la salud y buen estado físico, así como para la rehabilitación. Los músculos se fortalecen y simultáneamente se moldean con el uso de las pesas. Por lo tanto, un entrenamiento de pesas no tiene sólo un efecto deportivo sino también un efecto estético. Con el entrenamiento de pesas la grasa corporal se reduce más eficientemente que, por ejemplo, con el ciclismo, la natación o las salidas a correr.Set de mancuernas de 40 kg con barra ergonómica y cierres en forma de estrella.Para un entrenamiento profesional de pesas en la casa.Barras de pesas sólidas con una unión para convertir las 2 mancuernas en una barra larga y poder trabajar otros musculosSuperficies de agarre antideslizantes aprox. 40 cm cada unaCierres de rosca/cierres de estrella con anillos plasticos para asegurar que los discos de pesas estén siempre firmemente unidas a las barras.Asas antideslizantes - esto evitará que las manos se deslicen durante el entrenamientoCada una de las barras tienen dos roscas trapeciales robustas (para una fijación segura de los discos)Discos de pesas termo forrados en plástico para proteger el suelo y la integridad estructural del disco (de esta manera, se evita también el ruido molesto cuando las pesas son puestas en el suelo).4 Discos de 2,5 LB/ 1.25KG4 Discos de 5 LB / 4 Discos 2,5 KG8 Discos 6 LB / 8 Discos 3 KG4 Seguros de Estrella 2 Mancuernas Antideslizante de 1LB/0.5 KG cada una (50cm por barra)1 Conector para barra larga de 40 Cm (40 cm)', 549900, 3, 28, 5, 1, 1, '564427813'),
(288, 'Escritorio Mesa Graduable Plegable Multiuso Portátil', '123456789', 'Forma Singular S.A.S ubicada en la ciudad de Medellín, es una empresa con una amplia experiencia en la ejecución de proyectos de producción, suministro e instalación de mobiliario y obras civiles, tanto en el segmento Corporativo como en el segmento Hogar. Nuestra planta de producción cuenta con maquinaria italiana de última generación, una mano de obra experta y altamente calificada, que combinadas nos brindan la capacidad de fabricar desde los muebles más básicos hasta la carpintería completa de cualquier proyecto de gran magnitud y complejidad.------------------------Especificaciones-------------------*Base metálica: Pedestal en tubo perfilado, Base superior e inferior en lámina metálica con acabado en pintura electrostática horneada disponible en color blanco, negro o gris (se entrega para despacho en 5 días hábiles). *Superficie: producida en Aglomerado melamínico color blanco sencillo (MDP) de 15mm de espesor con enchape en canto rígido de PVC de 2mm de espesor termofundido en sus cuatro cantos.*Graduable en altura e inclinación.*Altura mínima: 64cm +/-2cm*Altura máxima (con superficie horizontal): 110cm +/-2cm.-------------------------------------------------*Usos sugeridos y restricciones: Como mesa auxiliar de trabajo, Versa es ideal pues se puede ubicar en casi cualquier lugar. La geometría de su base le permite ubicarse bajo la mayoría de asientos permitiendo que la superficie de apoyo quede lo más cercana posible al cuerpo facilitando un trabajo cómodo y divertido en cualquier lugar. Se recomienda guardar una postura cómoda al usarla.Al extender su brazo telescópico Versa puede ser usada para trabajar de pie o como soporte para PC o Tablet cuando se usan simuladores de ciclismo o se hace ejercicio. La superficie graduable en inclinación permite ubicar el celular o la tablet en un ángulo que facilite su visibilidad usando el tope que tiene como soporte para estos elementos.No se recomienda bajo ninguna circunstancia apoyarse sobre ella sentado o parado pues puede ocasionar caídas y/o deformaciones en la estructura.*Cuidados y limpieza: usar un paño húmedo suave (idealmente de microfibra). Puede usarse jabón suave (no abrasivo) sobre el paño húmedo y enjuagar inmediatamente con un paño húmedo suave (idealmente de microfibra). No se recomienda usar agua ni ningún otro tipo de líquido directamente sobre la superficie. En caso de derrames de líquidos, limpiar inmediatamente. Tanto las superficies de trabajo en aglomerado melamínico como las partes metálicas no son resistentes a la abrasión ni al rayado, por lo cual se debe evitar arrastrar objetos sobre ellas para evitar su rayado y deterioro; estos eventos no son cubiertos por la garantía de fábrica así como aquellos ocasionados por mal uso, golpes, sobre esfuerzos o cargas en la mesa.*Contenido en el empaque: 1 (una) mesa auxiliar de trabajo Versa.Las imágenes de referencia pueden variar los colores reales ligeramente.Computador, Celular, Tablet y demás elementos decorativos no incluidos.', 374900, 4, 41, 5, 5, 1, '564808991'),
