de envío. Cuando estés realizando la compra, se te indicará las fechas aproximadas de llegada, el cual ya depende de la transportadora, sin embargo nosotros estamos completamente pendientes de que te llegue. »» ¿Cómo hago seguimiento del envío?Ingresando a la plataforma de Mercado Libre, en el detalle de tu compra, se te va a disponibilizar un código con su respectivo link donde vas a poder hacer el seguimiento con la empresa encargada de entregarte el artículo.SOBRE MÉTODOS DE PAGO»» ¿Cómo se paga?Los pagos se realizan cuando le das “comprar” en la publicación a través de mercado pago, puedes realizarlo por todos los medios que te ofrece la plataforma. Tiene convenios con bancos seleccionados, en efectivo y a través de plataformas como PSE. No hay posibilidad de pagos contra entrega, ya que la compra se recibe hasta que se realiza el pago. SOBRE EXPERIENCIA DE COMPRA»» Tiene una compra totalmente segura, el producto si tiene stock disponible y a penas oferte, será despachado. Por el momento no ofrecemos ventas al por mayor o descuentos que no estén publicados en la plataforma. »» ¿Qué garantía tienen los productos?Este producto tiene garantía de 12 meses/1 año donde nos podrás informar cualquier inconveniente que tengas directamente la mensajería y con gusto te ayudaremos a resolver cualquier inquietud o inconveniente.  »»  ¡¡CUALQUIER OTRA DUDA, ESTAMOS A TU DISPOSICIÓN!! ¿Hacen Factura? Sí, hacemos factura. La misma se genera de forma automática a partir de los datos que cargas al momento de completar el checkout de tu compra, estos pueden ser a nombre de una persona física o empresa. Te pedimos que cargues la documentación correspondiente al efectuar la compra, en la sección \"Completa los datos para tu factura\".', 69900, 4, 128, 5, 1, 1, '565046043'),
