Mercadolibre para que generen una nueva guía; una vez entregado el producto a Servientrega no podrá realizar ningún cambio.4. ¿Puedo cambiar el producto por razones de talla o preferencia después de recibirlo?Si usted oferta y al momento de recibir el producto en su domicilio nota que va grande o pequeño, que el color no es de su agrado, tamaño o cualquier otro motivo sobre las especificaciones del mismo, Nikomar le ofrece la posibilidad de cambiarlo, sin embargo, el cliente deberá hacerse cargo de todos los costos de envío nacionales e internacionales tanto por la devolución del producto inicial como por la recepción de la nueva unidad. No obstante, nuestro objetivo es priorizar el feliz proceso de compra de nuestros clientes, y a fin de evitar costos adicionales le sugerimos consultar con nuestros asesores todas las dudas y detalles del producto antes de ofertar para que no sea necesario el cambio.5. ¿Todos los productos se encuentran en stock? Si todos los productos publicados están en stock pero siempre pedimos confirmar por el sistema de preguntas antes de realizar la compra. 6. ¿Se puede cancelar la compra? Una vez confirmada la oferta, el cliente dispondrá de 4 horas seguidas para solicitar la cancelación y el reintegro del dinero.7. GARANTÍA: Los artículos tienen garantía por defectos de fábrica únicamente. No nos hacemos responsables de los costos de envió en CAMBIOS por talla, color o diseño, confirme su producto antes de pedirlo, NO aplica GARANTÍA en daños causados por la empresa TRANSPORTADORA en Colombia a su domicilio, respondemos por daños de USA a nuestras bodegas.8. IMPORTANTE: La información de los productos que ves es traducida automáticamente por el sistema, si tienes dudas o información que no tengas clara, por favor realiza todas tus preguntas en la parte inferior.....................................- Cancelaciones: Antes de confirmar el envío.- Garantía adicional: Sujeta a la marca o vendedor.- Disponibilidad de envío sujeto a cobertura de Se