(302, 'Escritorio En L Color Duna Maderkit M01625', '123456789', 'ESCRITORIO EN L COLOR DUNA MADERKIT M01625Características Principales:COLOR: DunaMedidas: Escritorio 141 cm Ancho x 88 cm Alto x 120 cm Fondo Atributos: Escritorio con base para impresora y dos compartimientos laterales.Material: Fabricado en Madera Aglomerada (MDP) y Cubierta en Melaminico. Empaque: Empacado en 2 cajas que contienen: piezas en aglomerado, kit de herrajes, manual de armado y certificado de garantía.Observación: El precio no incluye ningún accesorio y/o elemento que no se describa en los atributos. El proceso de armado lo realiza directamente el comprador y/o usuario del producto. Maderkit no se compromete con la prestación de este servicio. La foto de este producto ha sido ambientada, el color presentado en la fotografía es una aproximación al color real.Garantía: Nuestros muebles tienen Garantía de 5 AÑOS sobre las piezas de aglomerado y 1 AÑO sobre el kit de herrajesEntrega: Despachamos en máximo 3 días hábiles después de concretada la compra. Entregamos en el transcurso de los 8 días hábiles..Costo de envío: Te invitamos a consultar la imagen con el listado de destinos a los cuales te obsequiamos el costo del envío. Si la ciudad de destino no se encuentra en el listado te invitamos a consultar el valor de envío antes de generar la compra.Datos para envío: Requerimos de los siguientes datos a fin de tramitar la facturación y el despacho:- Número de cédula para facturación. (Si es empresa debe adjuntar copia del RUT)- Nombre completo- Número de teléfono fijo y/o celular- Correo electrónico- Dirección de envío (indicar barrio, apto, bloque, manzana, etc)- Ciudad (Consultar cobertura en la imagen con listado de destinos)- Nombre y número de celular de quien recibe', 369900, 5, 231, 5, 5, 1, '567280731'),
