(304, 'Maleta Morral Semi Rígida Tedge Porta Casco ', '123456789', 'SOMOS TEDGE«===================================================»¡Somos Mercado Libre Motopartes TEDGE! Tienda Oficial y creamos artículos innovadores para que los lleves siempre contigo en tu aventura en moto, te ayudamos a lograr todos tus sueños en tu vehículo haciéndolo de manera segura con todos nuestros productos. Te brindamos la última tecnología siempre priorizando el diseño y la alta calidad con los mejores precios del mercado.«===================================================»Mochila Motociclista Moto Semi Rígida Porta Casco 27L Tedge - Built for RidersCARACTERÍSTICAS:•Marca: Tedge•Modelo: War•Color: Negro•Mochila semi rígida porta casco•Detalles reflectivos•Tirantes de hombros tipo paracaídas•Con correa de pecho y correa de cintura desmontable•Porta laptop•Cierre impermeable antirrobo y expansible•Cobertor de lluvia•Material: 100% Poliéster•Capacidad: 27 litros•Medidas: 49x35x16 cm•Origen: China«===================================================»««IMPORTANTE LEER, PREGUNTAS FRECUENTES»»«===================================================»SOBRE ENVÍOS»» ¿Se realizan envíos o se puede retirar en algún punto de venta? Nuestra tienda es totalmente virtual por lo que solamente manejamos envíos a todo el país a través de Mercado Envíos, por el momento no ofrecemos la posibilidad de retirar el producto en algún punto de venta. »» ¿Cómo se calculan los costos de envío?Los costos de envíos los calcula la plataforma según tu ubicación, no tenemos manejo directo sobre los costos. Si el producto es mayor de 70.000 tendrá envío gratis, si es menor la plataforma te indicará el precio del envío antes confirmar la compra. El precio publicado es únicamente el del producto cuando hagas clic en “Calcular cuándo llega” te indicará precio de envío adicional y fecha entregaPara saber más sobre costos de envíos puedes verlos desde aquí https://www.mercadolibre.com.co/ayuda/costos-de-envios.gratis_3287»» ¿Cómo es el proceso de envío?A penas realices la compra, despachamos el producto, nuestros envíos son FULL lo que significa que son rápidos y seguros (Que sea Full no significa que tenga envío gratis, eso depende del costo del producto como se indica en el punto anterior). Cuando estés realizando la compra, se te indicará las fechas aproximadas de llegada, el cual ya depende de la transportadora, sin embargo nosotros estamos completamente pendientes de que te llegue. »» ¿Cómo hago seguimiento del envío?Ingresando a la plataforma de Mercado Libre, en el detalle de tu compra, se te va a disponibilizar un código con su respectivo link donde vas a poder hacer el seguimiento con la empresa encargada de entregarte el artículo.SOBRE MÉTODOS DE PAGO»» ¿Cómo se paga?Los pagos se realizan cuando le das “comprar” en la publicación a través de mercado pago, puedes realizarlo por todos los medios que te ofrece la plataforma. Tiene convenios con bancos seleccionados, en efectivo y a través de plataformas como PSE. No hay posibilidad de pagos contra entrega, ya que la compra se recibe hasta que se realiza el pago. SOBRE EXPERIENCIA DE COMPRA»» Tiene una compra totalmente segura, el producto si tiene stock disponible y a penas oferte, será despachado. Por el momento no ofrecemos ventas al por mayor o descuentos que no estén publicados en la plataforma. »» ¿Por qué me piden tantos datos sobre mi residencia al ofertar? Sabemos que es importante la factura del producto para ti, por ello tenemos un sistema que las realiza las facturas automáticamente, para que se te envíe dicha factura el sistema pide algunos datos como códigos de departamento y municipio. »» ¿Cómo sé cuáles son los códigos de mi residencia, departamento y/o municipio? En las imágenes de cada publicación, al final tenemos una lista de todos los códigos ordenados alfabéticamente, puedes encontrar tus códigos allí y colocarlos al realizar la compra. Si deseas más información puedes encontrarlos en la página de la DIAN y en la página de Códigos postales si deseas saber específicamente el de tu residencia.»» ¿Qué garantía tienen los productos?Este producto tiene garantía de 12 meses/1 año donde nos podrás informar cualquier inconveniente que tengas directamente la mensajería y con gusto te ayudaremos a resolver cualquier inquietud o inconveniente.  »»  Si desean una Declaración de Importación deben comunicarse luego de la compra por la mensajería¡¡CUALQUIER OTRA DUDA, ESTAMOS A TU DISPOSICIÓN!! ¿Hacen Factura? Sí, hacemos factura. La misma se genera de forma automática a partir de los datos que cargas al momento de completar el checkout de tu compra, estos pueden ser a nombre de una persona física o empresa. Te pedimos que cargues la documentación correspondiente al efectuar la compra, en la sección \"Completa los datos para tu factura\".', 229900, 2, 52, 5, 3, 1, '567849935'),
