(320, 'Cápsulas Café Nespresso Pack Ispirazione Italiana X 50', '123456789', 'En Nespresso presentamos Ispirazione Italiana, una selecta gama de cafés específicamente diseñados para capturar el sabor y la experiencia de tostado de las regiones italianas que los inspiraron. Viajamos a lo largo y ancho de Italia para traerte estos cafés que simbolizan el método único de cada región para tostar café. Con cada sorbo de nuestras variedades inspiradas en Italia, te invitamos a hacer un viaje por este magnifico país.Este pack contiene 50 cápsulas de café Nespresso:- 10 cápsulas de café Ispirazione Napoli : excepcionalmente oscuro y cremoso. - 10 cápsulas de café Ispirazione Venezia: armoniosamente equilibrado y espeso. - 10 cápsulas de café Ispirazione Ristretto Italiano : potente y diferente. - 10 cápsulas de café Ispirazione Firenze Arpeggio: intenso y cremoso.- 10 cápsulas de café Ispirazione Roma : completo y balanceado.Conoce más acerca del mundo Nespresso:https://www.mercadolibre.com.co/a/store/nespresso• Sostenibilidad: ya sea comprando granos de agricultores acreditados por el programa AAA, plantando 3.5 millones de árboles en pequeñas fincas de café o usando aluminio responsable y rastreable para nuestras cápsulas reciclables, Nespresso siempre pone la sostenibilidad y la calidad primero.* Ten en cuenta que el café al ser un producto alimenticio y contar con fecha de de vencimiento, se encuentra dentro de las excepciones donde no opera el derecho a retracto.', 105000, 5, 203, 5, 8, 1, '570586626'),
