(332, 'Ocobo Rosado Semillas Guayacan Para Maceta Bonsai Jardin  ', '123456789', 'TECNOKREAR: Semillas para árbol Ocobo rodado Tabebuia rosea, guayacán rosado, Semillas muy especiales para aprovechar espacios reducidos y decorar. Son semillas increibles ya que se pueden utilizar para producir arboles destinados a decorar ambientes de 2 formas: 1) para adornar un espacio reducidos como el balcón de un apartamento, un pasillo o en un jardín con un bonsái en tamaño grande espectacular de árbol de Ocobo rosado, Tabebuia rosea de unos 120 a 180 cm de altura en maceta; 2) también lo puedes sembrarlo directamente en el suelo de un patio, jardín o huerto y usarlo en tamaño grande que te sirve como decoración del ambiente, jardín, la entrada de la casa o en el huerto e igualmente al ser de gran tamaño te servirá de sombreo.BENEFICIOS Y USOS1) Para el embellecimiento y decoración de espacios interiores y exteriores.a) En maceta para adorno de pasillos, balcones, jardín, huerto o huerto.b) De gran tamaño para sombra y adorno de jardín y entradas de propiedades y edificaciones2) Protección de la radiación solar. 3) Purificación del aire.4) Relajante y des estresante al concentrarse en el crecimiento, progresos y cuidados.5) Agradable olor que sirve como ambientador en cualquier espacio.CON LA COMPRA RECIBES100 semillas de Ocobo rosado, Tabebuia rosea, para espacios reducidos o sembrado directo en el suelo+ 190 semillas de regalo50 semillas de guayaba dulce para bonsái, maceta o suelo20 semillas de pino ciprés, para bonsái, maceta o suelo 20 semillas de tomate chonto20 semillas de cilantro30 semillas de zanahoria20 semillas del col tallos30 semillas de perejil.Referencia de semilla: TK772Tipo de semilla: Variedad mejorada Tiempo de germinación: 15-45 díasAltitud: 0 a 1.600 metros sobre el nivel del marPara la germanización, la temperatura debe ser de :18-28 grados centígradosEmpaque: Sobre protegido con espumaVIDEOS TUTORIALES GRATIS1) - Como germinar la semilla de Ocobo rosado, Tabebuia rosea2) - Cuidados básicos de Ocobo rosado, Tabebuia rosea, 3) - Como plantar y mantener una planta en matera4) - Como hacer de una plata un bonsái grande en maceta . técnicas básicas5) - Manual básico de germinación y sembrado de semillas de regalo adicionales6) - Acceso a Grupo facebook Ideas y productos para tu jardínPAGO Y ENVÍOPAGO:Pago con seguro de protección al comprador por medio de MercadoPagoENVÍO: A toda Colombia.ARBOL DE Ocobo rosado, Tabebuia rosea, guayacan rosado: Árbol de 6 a 10 m de altura, aunque en su hábitat nativo puede superar los 25 m. Tronco corto de corteza grisácea, algo fisurada. Hojas palmadas, compuestas de 3-5 foliolos elípticos a oblongos grandes (hasta 34 cm de largos). Las inflorescencias surgen en panículas terminales. Las flores tienen cáliz acampanado y bilabiado con pétalos rosa, lavanda o magenta. El fruto es una cápsula linear, cilíndrica de 22-35 cm de longitud con 7 a 10 semillas aladas. Estas alas son asimétricas e irregulares, con el fin de poder dispersarse a cierta distancia del árbol original. El cuerpo de la semilla está formado por dos pequeños discos lenticulares soldados entre sí, también asimétricos para favorecer la dispersión con el viento.1Distribución y hábitatSe encuentra generalmente en bosques tropicales perennifolios, tropicales subcaducifolios y caducifolios.Se distribuye en México, en la vertiente del golfo de México, desde el sur de Tamaulipas y norte de Puebla y Veracruz, predominando en el estado de Tabasco hasta el norte de Chiapas y sur de Quintana Roo; en la vertiente del Pacífico se extiende desde Sinaloa hasta Chiapas. En prácticamente toda Centroamérica y en la Sudamérica tropical, Venezuela, Colombia y regiones costeras del Ecuador. También en algunas islas del Caribe, como Santo Domingo.En la República de El Salvador es su árbol nacional.En España se cultiva en Canarias y puntos templados del litoral peninsular.Cultivo y usosSe multiplica por semillas; crecimiento mediano. Requiere climas cálidos con suelos húmedos y fértiles.1Crece desde el nivel del mar hasta los 1600 msnm. Se adapta a diferentes tipos de suelo, incluso los pobres; tolera la inundación estacional.Se desarrolla en forma óptima con temperaturas entre 20 a 27 °C y zonas con precipitaciones entre 1500 y 1500 mm.[cita requerida]UsosMaderaLa madera es utilizada en diseño de interiores de muebles finos, pisos, gabinetes, chapas decorativas, construcción de botes, ebanistería, ruedas para carretas,artesanías, cajas y embalajes. Es utilizada como ornamental, en parques, jardines y linderos de propiedades. Asimismo es utilizada como planta de sombra de cultivos en las zonas bajas de la región tropical.Tiene duramen blanco o gris (pardo rosado claro), uniforme. Albura similar al color del duramen. Su peso específico es de 0,5–0,6 g/cm³; los vasos son de porosidad difusa; agrupados en grupos radiales cortos (de 2–3 vasos). Dos clases distintas de diámetro de vasos ausentes. Promedio del diámetro tangencial de los vasos: 85–140 µm. Promedio del número de vasos/mm²: 13–22. Promedio del largo de los elementos vasculares: 332–386 µm. Placas de perforación simples. Punteaduras intervasculares alternas, promedio del diámetro (vertical) de las punteaduras intervasculares: 3–6 µm. Punteaduras radiovasculares con aréolas distintas, similares a las punteaduras intervasculares. Engrosamientos en espiral ausentes. Los radios por mm: 18–19, radios multiseriados con 2–4 células de ancho. Radios compuestos por un solo tipo de células (homocelulares); células de los radios homocelulares procumbentes.Tiene estructura estratificada, todos los radios estratificados, parénquima axial estratificado, elementos de vasos estratificados, fibras estratificadas. Dispone los estratos regulares (horizontal o recto), o irregular. Número de estratos por mm axial 3–4. No tiene canales intercelulares. Cristales muy esporádicamente, observados apenas en algunas muestras. Sin sílica. El duramen no fluorescente. Extracto acuoso fluorescente, o no fluorescente (azul); básicamente amarillo o tonalidades de amarillo (amarillo claro).Uso en la medicina popularLa infusión de las hojas se utiliza como febrífugo. La corteza cocida sirve para la diabetes, paludismo, tifoidea y parásitos.', 19950, 1, 74, 5, 8, 1, '573115446'),
(333, 'Lluvia De Oro Semillas Para Maceta Bonsai Jardin Paisajismo', '123456789', 'Semillas muy especiales para aprovechar espacios reducidos y decorar. TECNOKREAR: Estas semillas para árbol lluvia de oro, son semillas que se pueden utilizar para producir arboles destinados a decorar ambientes de 2 formas: 1) para adornar un espacio reducidos como el balcón de un apartamento, un pasillo o en un jardín con un bonsái en tamaño grande espectacular de árbol de Lluvia de oro de unos 120 a 180 cm de altura en maceta; 2) también lo puedes plantar directamente en el suelo de un patio, jardín o huerto y usarlo en tamaño grande que te sirve como decoración del ambiente, jardín, la entrada de la casa o en el huerto e igualmente al ser de gran tamaño te servirá de sombreo.BENEFICIOS Y USOS1) Para el embellecimiento y decoración de espacios interiores y exteriores.a) En maceta para adorno de pasillos, balcones, jardín, huerto o huerto.b) De gran tamaño para sombra y adorno de jardín y entradas de propiedades y edificaciones2) Protección de la radiación solar. 3) Purificación del aire.4) Relajante y des estresante al concentrarse en el crecimiento, progresos y cuidados.5) Agradable olor que sirve como ambientador en cualquier espacio.CON LA COMPRA RECIBES50 semillas de Lluvia de oro, para espacios reducidos o sembrado directo en el suelo+ 190 semillas de regalo50 semillas de guayaba dulce para bonsái, maceta o suelo20 semillas de pino pátula, para bonsái, maceta o suelo 20 semillas de tomate chonto20 semillas de cilantro30 semillas de zanahoria20 semillas del col tallos30 semillas de perejil.Referencia de semilla: TK739Tipo de semilla: Variedad mejorada Tiempo de germinación: 3-12 díasAltitud: 0 a 1.200 metros sobre el nivel del marPara la germanización, la temperatura debe ser de :18-28 grados centígradosEmpaque: Sobre protegido con espumaVIDEOS TUTORIALES GRATIS1) - Como germinar la semilla de Lluvia de oro2) - Cuidados básicos de Lluvia de oro, 3) - Como plantar y mantener una planta en matera4) - Como hacer de una plata un bonsái grande en maceta . técnicas básicas5) - Manual básico de germinación y sembrado de semillas de regalo adicionales6) - Acceso a Grupo facebook Ideas y productos para tu jardínPAGO Y ENVÍOPAGO:Pago con seguro de protección al comprador por medio de MercadoPagoENVÍO: A toda Colombia.ARBOL DE Lluvia de oro: Lluvia de oro, un precioso árbol de flores colgantesEs uno de esos árboles de los cuales parece que llueve oro durante cada primavera. Sus preciosas y pequeñas flores amarillas colgantes cubren toda la planta, haciendo que se vea espectacular. Además, queda fantástico como ejemplar aislado, pero también se podría utilizar en alineaciones o en grupos.Conoce los cuidados de la Lluvia de oro, una especie ideal para dar color a tu jardín.Origen y características de la lluvia de oroComo decíamos, en primavera brotan de él flores agrupadas en racimos colgantes que llegan a medir de 10 a 20 centímetros, y son de un magnífico color amarillo. El fruto es una legumbre, por lo que pertenece a la familia botánica Fabaceae (leguminosas). Esta contiene semillas negruzcas y muy duras, y son tóxicas.Popularmente se la conoce como caña fístula o lluvia de oro, pero a diferencia del Laburnum anagyroides, no es en absoluto tóxico. De hecho, se utiliza como laxante, astringente y como remedio para golpes leves.¿Cuáles son los cuidados que hay que proporcionarles?La lluvia de oro, tanto la de climas templados como la de climas cálidos, son plantas que se cuidan bien y fácil si el clima es el adecuado para ellas. Es decir, el Laburnum anagyroides se verá precioso en las regiones templadas, donde haya heladas; por el contrario, la Cassia fistula crecerá de maravilla si las temperaturas son suaves o cálidas todo el año.Sepamos cuáles son los cuidados básicos que hay que darles:UbicaciónAmbos árboles se tienen que colocar en el exterior. Es muy recomendable que les dé el sol, al menos unas horas al día, pero viven razonablemente bien en lugares con sombra parcial.Si hablamos de sus raíces, no se desarrollan mucho en comparación con otras plantas, pero se deben de plantar a una distancia de unos 5 metros como mínimo de tuberías y de suelos que se hayan pavimentado.RiegoEstos árboles requieren agua con frecuencia, por ello se han de regar en cuanto se vea que la tierra empieza a secarse. Esto ocurrirá más seguido en verano que en invierno, y aún más si el clima es seco y cálido, por lo que has de estar atento.Si dudas sobre cuándo regar, introduce un palo delgado de madera: si al extraerlo sale con poca o ninguna tierra adherida a él, entonces tendrás que coger la regadera y humedecerla.TierraJardín: los dos crecen en suelos fértiles, y con una buena capacidad de drenaje del agua.Maceta: este es un recipiente que ha de tener agujeros en su base. Como sustrato puedes utilizar mantillo, sustrato universal, o similares.AbonadoAparte de agua, es aconsejable abonar a tu lluvia de oro durante su temporada de crecimiento, es decir, en primavera y verano. En el mercado hay muchos tipos de abonos, pero se pueden clasificar en dos grandes grupos: los químicos y los orgánicos. Ambos pueden ser de gran utilidad si se usan bien, pero aconsejamos usar estos últimos ya que así se contribuye a cuidar de la fauna (y flora) que hay en tu jardín.', 19950, 4, 172, 5, 8, 1, '573125841'),
(334, 'Chaqueta Alpinestars Andes V2', '123456789', 'De pie en la cumbre de los Andes originales, la chaqueta Alpinestars Andes V2 Drystar lleva la funcionalidad de varias estaciones a nuevas alturas con un control de temperatura enormemente mejorado.Donde la ventilación era anteriormente algo limitada, permitiendo solo el intercambio de calor y humedad a través de la membrana Drystar (y restringiendo la aplicación a las 3 estaciones más frías), se ha incorporado una ventilación directa altamente eficiente en la chaqueta Alpinestars Andes Drystar versión 2, logrando una verdadera adaptabilidad de 4 estaciones para el jinete de aventura y turismo.CARACTERISTICASTejido de poliéster reforzado avanzado y construcción impermeable y transpirable DrystarSistema de ventilación directa (DVS) tomas de aire en el pecho con cremallera y puertos de escape traserosProtección contra impactos internos provista por protectores extraíbles de codos y hombros con certificación CEBolsillos para protección opcional para el pecho y la espalda (se venden por separado)Textura reforzada con impresión de polímero en áreas críticas del codo y la parte inferior del brazo para resistencia a la abrasiónLos detalles y logotipos gráficos reflectantes mejoran la visibilidad del conductor en diferentes condiciones de luzLos bolsillos para las manos con cremallera superior en el pecho cuentan con un cordón interno que funciona en tándem con abertura de ventilación para garantizar niveles de ventilación personalizadosBolsillos de carga frontales impermeables para mayor comodidad y cierre tranquilo.Gran bolsillo externo para servicios públicos en la parte inferior de la espalda más bolsillos internos impermeables y bolsillo para billetera insertadaCuello de borde suave integrado y construcción de malla 3D para mayor comodidad en largas distancias.Mangas pre-contorneadas con paneles elásticos de acordeón en los codos.La cremallera YKK premium con controles deslizantes dobles para el cierre frontal principal ofrece una comodidad adaptable y seguraEl forro térmico de manga larga extraíble (cuerpo de 100 g / mangas de 80 g) garantiza la comodidad en días calurosos o fríosCierre de ajuste de cintura marca VELCRO® para un ajuste altamente personalizableBolsillos externos con cremallera para un almacenamiento seguro y tranquilo.INFORMACION IMPORTANTENuestros horario de atencion al publico es de lunes a viernes de 07:30 a 17:30 hrs. Todos los despachos se realizan antes de las 24 hrs habiles posterior a la compra.Los fines de semana y festivos no se realizan despachos. Las compras realizadas los dias viernes despues de las 12:00 hrs, sabados y domingos; son despachadas el dia lunes en la mañana. Si el fin de semana incluye festivo, las ventas durante este se despachan el dia de martes en la mañana.', 1005900, 5, 175, 5, 3, 1, '573162551'),
