(351, 'Compostera Urbalive Rehau', '123456789', 'COMPOSTERA URBALIVE. Un ayudante milagroso para el compostaje casero.Urbalive logra convertir la basura de la planta de su hogar en té de compost. Lo hace de manera ordenada e inodora, garantizada. No solo haces uso de una mercancía valiosa, sino también obtendrás un fertilizante orgánico de alta calidad para el cultivo de plantas de interior y exterior.Las lombrices de tierra hacen su trabajo y hacen compost, y un recipiente recolecta el té de gusano. Las elegantes piernas de la Compostera están hechas de madera certificada FSC, lo que significa que fue cultivado y procesado de manera ecológica.El compost contiene enzimas activas y hormonas de crecimiento natural. Se puede agregar al suelo en macetas y jardines. El té de gusano es un líquido brillante, fertilizante que contiene grandes cantidades de nutrientes y enzimas que ayudan a las plantas a crecer y resistir enfermedades y plagas.Garantía: 6 meses.¿Qué hace REHAU? De todo.Somos una empresa familiar de origen alemán, y la innovación está en nuestro ADN.Estamos en todas partes: en las mangueras y accesorios de jardín, en los muebles de tu casa u oficina, en las ventanas. También en tu nevera, en un avión y hasta en tu auto.Estamos en más de 170 locaciones en todo el mundo. Somos más de 20.000 colaboradores que trabajamos con la misma pasión de nuestro fundador: mejorar la calidad de vida de las personas y liderar el progreso.Encuentra la mejor calidad de nuestros productos con tecnología alemana aquí: esta es la Tienda Oficial de REHAU.', 599900, 2, 17, 5, 8, 1, '578131807'),
