al en Zoom, Team y Xsplit fácilmente mientras se transmite o transmite. Es compatible con Word, Powerpoint OneNote y más. También es perfecto para tomar notas, anotar ideas y firma de negocios durante conferencias web y trabajo remoto. Si tiene duda con la compatibilidad de algún programa consultarnos.•Rendimiento preciso del bolígrafo: el bolígrafo digital PW100 cuenta con 8192 niveles de sensibilidad a la presión, resolución de bolígrafo 5080LPI y prácticamente sin retraso, lo que te proporciona una precisión y control íntimos. •También es libre de batería, no necesita cargar más. Los botones laterales del bolígrafo te ayudan a cambiar entre el bolígrafo y el borrador o al instante. Viene con 8 puntas adicionales en el soporte para bolígrafo.•6 teclas de presión personalizadas: configura las 6 teclas de expreso programables a cualquier combinación de acceso directo que prefieras en el controlador Huion y optimiza tu flujo de trabajo. También funciona tanto para usuarios diestros como zurdos.•Compacto y portátil: la tableta de arte H640P está diseñada con un tamaño delgado y compacto con un área activa de 6.3 x 3.9 pulgadas que ofrece un espacio creativo perfecto para áreas de escritorio limitadas. Es fácil de llevar a cabo y siempre listo para su creación en cualquier momento y lugar.***OTROS MODELOS DISPONIBLES: HUION HS64 Y HUION 1060 PLUS****************************************************************************************************GARANTÍAEste es un producto importado, el proveedor en los Estados Unidos brindan 30 días de garantía DIRECTA, la cual se extiende al comprador, esta garantía es SÓLO por defectos de fabricación, NO INCLUYE mala manipulación POR PARTE DEL USUARIO. Los costos de envío en garantías corren por parte del comprador.Para solicitar una garantia el producto debe tener las etiquetas intactas, caja y accesorios que recibio. En caso de presentarse un mal uso por parte del usuario no aplica la garantia.', 209990, 4, 133, 5, 9, 1, '581951054'