(403, 'Conector Adaptador Union Hdmi Hembra A Hdmi Hembra', '123456789', 'Hola, Mucho gusto mi nombre es Libardo Leal, a usted que esta leyendo esto le quiero decir que estoy comprometido con cada uno de mis compradores, en el momento que decidas comprar este o alguno de los productos que ofrezco, es importante que sepas lo siguiente:*Si esta publicado en MercadoLibre esta disponible en nuestro stock*Revisamos y ensayamos cada uno de nuestros productos, para minimizar disgustos en su compra*Contamos con un servicio POS-Venta dedicado vía WhatsApp o telefónicamente*Contamos con una garantía verdadera sobre cada uno de nuestros productos*Solo manejamos productos originales*Despachamos lo antes posible su pedido*Empacamos cuidadosamente para que llegue en perfecto estado lo que ofrecemosPor lo anterior quedamos atentos a cualquier duda en el apartado de preguntas (Recuerda no incluir datos de contacto en estas misma).Si realizas la compra estaremos 100% dispuestos a prestar nuestros servicios con total responsabilidad. ----------------------------------//----------------------------------Adaptador Unión HDMIENVÍOS:MERCADO_ENVÍOS:Si su compra es realizada antes de la 12:00PM su pedido se despacha el mismo día, sino al siguiente día hábil.CARACTERISTICAS:-1 Conector Entrada, HDMI (Hembra)-1 Conector de Salida, HDMI (Hembra)GARANTÍA:La garantía cubre daños o imperfectos de fabrica, no cubre daños causados por el usuario, este producto cuenta con 30 días de garantía.', 5000, 2, 23, 5, 9, 1, '589728076'),
(404, 'Escritorio Con Cajones Amaretto - Inval Es4603', '123456789', 'ESCRITORIO ANCHO 120CM INVAL ES4603 - INVAL====== Descripción ======Escritorio con un cajón y compartimiento para que almacenes o decores el estudio a tu gusto.INFOALTURA: 75 CMANCHO: 120 CMPROFUNDIDAD: 50 CMPESO: 28,0 KGMATERIAL: MADERA AGLOMERADA RECUBIERTA CON MELAMINA - MDP', 249900, 1, 32, 5, 5, 1, '590105443'),
(405, 'Termo Botella Begônia Acero Inoxidable Con Asa 500 Ml', '123456789', 'TIENDA OFICIAL BEGÔNIA«===================================================»Somos Begônia, tienda oficial y queremos ayudarte a tener un hogar único. Para ello, creamos productos de alta calidad y con un diseño exclusivo que se adapta a tu hogar, cuidando los precios para que sean totalmente accesibles. Verás productos que siguen las últimas tendencias para que disfrutes todos los días y puedas tenerlo al alcance de tus manos y lo más pronto posible. «===================================================»Botella Metálica Plateada 500 Ml BegoniaESPECIFICACIONES DEL PRODUCTOBotella de Acero Inoxidable, de 500 ML Color Plateado, el producto perfecto para que lleves tanto tus bebidas calientes como frías. La temperatura se mantiene por 12 hs frio y 8 hs caliente «===================================================»««IMPORTANTE LEER, PREGUNTAS FRECUENTES»»«===================================================»SOBRE ENVÍOS»» ¿Se realizan envíos o se puede retirar en algún punto de venta? Nuestra tienda es totalmente virtual por lo que solamente manejamos envíos a todo el país a través de Mercado Envíos, por el momento no ofrecemos la posibilidad de retirar el producto en algún punto de venta. »» ¿Cómo se calculan los costos de envío?Los costos de envíos los calcula la plataforma según tu ubicación, no tenemos manejo directo sobre los costos. Si el producto es mayor de 70.000 tendrá envío gratis, si es menor la plataforma te indicará el precio del envío antes confirmar la compra. El precio publicado es únicamente el del producto cuando hagas clic en “Calcular cuándo llega” te indicará precio de envío adicional y fecha entregaPara saber más sobre costos de envíos puedes verlos desde aquí https://www.mercadolibre.com.co/ayuda/costos-de-envios.gratis_3287»» ¿Cómo es el proceso de envío?A penas realices la compra, despachamos el producto, nuestros envíos son FULL lo que significa que son rápidos y seguros (Que sea Full no significa que tenga envío gratis, eso depende del costo del producto como se indica en el punto anterior). Cuando estés realizando la compra, se te indicará las fechas aproximadas de llegada, el cual ya depende de la transportadora, sin embargo nosotros estamos completamente pendientes de que te llegue. »» ¿Cómo hago seguimiento del envío?Ingresando a la plataforma de Mercado Libre, en el detalle de tu compra, se te va a disponibilizar un código con su respectivo link donde vas a poder hacer el seguimiento con la empresa encargada de entregarte el artículo.SOBRE MÉTODOS DE PAGO»» ¿Cómo se paga?Los pagos se realizan cuando le das “comprar” en la publicación a través de mercado pago, puedes realizarlo por todos los medios que te ofrece la plataforma. Tiene convenios con bancos seleccionados, en efectivo y a través de plataformas como PSE. No hay posibilidad de pagos contra entrega, ya que la compra se recibe hasta que se realiza el pago. SOBRE EXPERIENCIA DE COMPRA»» Tiene una compra totalmente segura, el producto si tiene stock disponible y a penas oferte, será despachado. Por el momento no ofrecemos ventas al por mayor o descuentos que no estén publicados en la plataforma. »» ¿Por qué me piden tantos datos sobre mi residencia al ofertar? Sabemos que es importante la factura del producto para ti, por ello tenemos un sistema que las realiza las facturas automáticamente, para que se te envíe dicha factura el sistema pide algunos datos como códigos de departamento y municipio. »» ¿Cómo sé cuáles son los códigos de mi residencia, departamento y/o municipio? En las imágenes de cada publicación, al final tenemos una lista de todos los códigos ordenados alfabéticamente, puedes encontrar tus códigos allí y colocarlos al realizar la compra. Si deseas más información puedes encontrarlos en la página de la DIAN y en la página de Códigos postales si deseas saber específicamente el de tu residencia.»» ¿Qué garantía tienen los productos?Este producto tiene garantía de 12 meses/1 año donde nos podrás informar cualquier inconveniente que tengas directamente la mensajería y con gusto te ayudaremos a resolver cualquier inquietud o inconveniente.  »»  Si desean una Declaración de Importación deben comunicarse luego de la compra por la mensajería¡¡CUALQUIER OTRA DUDA, ESTAMOS A TU DISPOSICIÓN!! ¿Hacen Factura? Sí, hacemos factura. La misma se genera de forma automática a partir de los datos que cargas al momento de completar el checkout de tu compra, estos pueden ser a nombre de una persona física o empresa. Te pedimos que cargues la documentación correspondiente al efectuar la compra, en la sección \"Completa los datos para tu factura\".', 49900, 5, 92, 5, 1, 1, '590622839'),
(406, 'Batería De Cocina T-fal 14piezas Excite Azul Antiadherente T', '123456789', 'Productos Originales directamente desde T-FalBatería 14 piezas EXCITE T-Fal, cuenta con base difusora especial para distribuir de manera uniforme el calor; incluye thermo spot que cambia de color e indica cuando está listo para empezar a cocinar, así conservas mejor la textura y nutrientes de los alimentos, Innovador revestimiento en antiadherente reforzado con una capa anti-rayaduras para un deslizamiento más duradero todos los días. - Base difusora- Antiadherente T-Fal- Thermo Spot- Resistente a rayaduras¡Estamos donde tu decides comprar! ¡Compra Seguro con T-Fal y Mercado Libre!', 425900, 3, 58, 5, 5, 1, '590858773'),
(407, 'Centro De Computo + Biblioteca Superior - Inval Cc741 Wengue', '123456789', 'Centro de Computo Inval CC741 ====== Descripción ======Centro de cómputo con portateclado y biblioteca superior ideal para complementar tu oficina o estudio. Fabricado por Inval S.A. industria dedicada a la fabricación de muebles listos para armar con más de 30 años de experiencia en el mercado.Mueble fácil de armar, se requiere de herramienta básica para el ensamble.Fabricado en Madera Aglomerada (MDP) y Cubierta en Melamínico.INFOMedidas: Altura 124 cm, Ancho 80 cm y Profundidad 42,5 cm.', 194900, 5, 45, 5, 5, 1, '591765472'),
(408, 'Balon Baloncesto Basketball Wilson Replica Oficial Fiba 3x3 ', '123456789', 'TIENDA OFICIAL WILSONLa Marca Nº 1 de Tenis en el Mundo.Wilson fabrica los productos más innovadores con diseños de vanguardia que potencian las habilidades de sus usuarios.Marca presente en todo el país. Compre con confianza.Horario de Atención: lunes a viernes de 9:00 am 6:00 pm y sábados de 9:00 am a 11:00 pm.DESCRIPCIÓN DEL PRODUCTO: FIBA 3x3 REPLICABasada en la pelota de baloncesto oficial FIBA 3x3, la réplica ofrece todas las prestaciones y especificaciones excepcionales del original. Además, cuenta con un núcleo acolchado, que ofrece una sensación más suave y un agarre mejorado que prefieren los jugadores.CARACTERÍSTICAS:- OFICIAL FIBA 3x3: Construido para seguir una apariencia similar a la pelota de juego oficial de FIBA 3x3 Basketball.- TAMAÑO 6: Esta pelota de baloncesto de 28.5 \" / 72.39 cm es ideal para niñas de 9 años en adelante y niños de 9-11 años.- WAVE TECH: La tecnología Wave Triple Threat utiliza ranuras en la superficie de la pelota para maximizar los puntos de agarre fáciles de encontrar.- AGARRE ELEVADO: Los canales de guijarros brindan una cobertura de superficie del 100% del balón para maximizar los puntos de agarre.- EXTERIOR: Construido para dominar el entorno de baloncesto al aire libre.--- SE REALIZAN VENTAS AL MAYOR ---¿CÓMO COMPRAR?:PAGOS:- MercadoPagoENVÍOS:- Mercadoenvíos- Coordinadora Mercantil (Contra entrega)RECOMENDACIONES:- Por favor aclare todas tus dudas en la sección de preguntas antes de ofertar.- Siempre consúltenos la disponibilidad del color, la talla o el tamaño de su preferencia.- Actualice el teléfono, correo y dirección para poder contactar y enviar el producto correctamente. No nos hacemos responsables por -contratiempos causados por datos erróneos.- Las compras acreditadas antes de las 2:30 pm serán enviadas el mismo día hábil. Después de las 2:30 pm el envío se realizará el día hábil -siguiente. PREGUNTAS FRECUENTES:1. ¿Hacen envíos a todo el País?Si. A través de Mercado envíos y Coordinadora Mercantil (Contra Entrega).2. ¿Desde qué ciudad realizan los envíos?Todos nuestros productos son despachados desde nuestro almacén en Bogotá.3. ¿Puedo retirar mi producto personalmente?Si. Por nuestra sede en Bogotá, Fontibón.GARANTÍA:- Todos nuestros productos están garantizados por 3 meses contra defectos de fábrica.- La garantía no cubre abuso, descuido, mal uso o desgaste natural por el uso.', 99990, 5, 161, 5, 1, 1, '591785660');
