(409, 'Kit  Mancuernas, Bandas Cerradas X5, Balón Pelota Pilates ', '123456789', '¡No necesitas un gimnasio para mejorar tu condición y fortalecer el cuerpo! Un Balón de pilates puede ser la solución más efectiva para lucir una figura de impacto y mejorar tu salud. Con ejercicios realizados correctamente Las bandas elásticas y las mancuernas pueden ser las herramientas ideales para obtener la musculatura deseada.Incluye cuatro artículos: Balón de pilates, dos mancuernas y Set de bandas elásticas (5 unidades).• Dos (2) mancuernas con un peso de 2 Libras cada una, Colores disponibles gris y negro. (Despacho aleatorio según disponibilidad) .Material plástico inyectado, antideslizante y fácil de limpiar con relleno. No daña ni mancha el piso como otras de hierro (ideal para uso domestico).• Balón de pilates de 50cm de diámetro inflado, de color aleatorio.• Set x 5 Bandas elásticas cerradas; Banda verde con 5Lb de resistencia, Banda azul con 15Lb de resistencia, Banda amarilla con 20Lb de resistencia, Banda roja con 30Lb de resistencia y Banda negra con 40Lb de resistencia. Cada Banda mide 60cm de circunferencia * 4.5cm de ancho.**********************************************************************Somos Mercado Líder Platinum!! Máxima distinción para los mejores vendedores en línea con excelente calificación por parte de miles de clientes satisfechos. Distribuimos solo artículos nuevos. Su compra está protegida con la garantía del vendedor y el programa Mercado Pago. **********************************************************************', 89900, 4, 116, 5, 1, 1, '591795230'),
(410, 'Chaqueta De Protección Para Moto Fenix Black', '123456789', 'Chaqueta de Protección para Moto Fenix Black\r==== Descripción ====\rLa Chaqueta Fenix de Pigmalion nace como la combinación de lo urbano y la protección que necesitas.Está fabricada en lona 100% poliéster que ayuda a que la chaqueta sea más liviana. Gracias a sus reflectivos ubicados en las mangas, frente y espalda, se eleva la seguridad pasiva al máximo nivel. incluye sistema de capucha por broches que te permite retirarla en cualquier momento.Viene con cierres impermeables, bolsillos en frente, posee un sistema de ventilas en frente y espalda para gran frescura, sistema de correas de ajuste con velcro en los puños y ajuste de cordón en cintura.La Chaqueta Fenix de Pigmalion está fabricada en lona de alta tenacidad, supera las pruebas más exigentes en términos de fricción y desgarro para evitar raspones y mitigar las posibles lesiones y adicional a eso su corte ajustado al cuerpo.Incorpora las protecciones en Hombros codos y espalda certificadas por la norma europea CE1621-1 fabricadas en poliuretano inyectado de alta densidad en hombros, codos y espalda para mitigar el impacto y evitar lesiones de mayor relevancia.\r- Condición: No especificado\r- GarantÍa: 6 meses de garantía en cualquier defecto de fabricación (costuras o cierres). No Aplica garantía por mal uso de la prenda.\r\raccesorios, antifricción, chaquetas, jackets, motocicleta, motocilistas, protección', 299000, 2, 44, 5, 3, 1, '592258035'),
(411, 'Impresora Etiquetas Codigo De Barras Auto Adhesiva Bluetooth', '123456789', '»»»»»»»»»»»»»»»»»»»»»»»»»»«« MEDELLIN ELECTRONICA »»««««««««««««««««««««»»»»»»»»»»»»»»»»»»»»»»»»»»»«« Todo en Computación y más »»««««««««««««««««««Características:- Con almacén de papel ajustable, se puede utilizar en una variedad de papeles de impresión.- Impresión térmica sin cinta, sin consumibles, impresión por carga de papel.- Coloque rápidamente el papel con un sensor de papel doble para garantizar una posición de impresión precisa.- Admite papel de etiquetas de hasta 110 mm de ancho, también se puede imprimir fácilmente en grandes anchos.- Lenguaje de programación CPCL y TSPL.Especificaciones:- Método de impresión: Impresión térmica de líneas Velocidad principal: 160 mm/s- Número total de puntos: 203 puntos / línea- Cortador de papel automático: NO- Ancho de impresión: 100 mm (MAX)- Sistema compatible: Win9X / Win2000 // Win2003 / Win Vista / Win 7 / Window XP / win 8 / win8.1 / Win 10 / IOS / Android / Mac OsContenidos del paquete:1 x Impresora bluetooth1 x Adaptador de cargador1 x Cable USB1 x CD de controladores1 x Manual en inglés*PARA CONCEPTO DE GARANTÍA O RETRACTO, EL CLIENTE DEBE ASUMIR LOS COSTOS DE LOS ENVÍOS*', 469900, 4, 181, 5, 7, 1, '592471281'),
(412, 'Saco De Boxeo 100 Cm + Soporte De Pared + Guantes Mma', '123456789', 'SACO DE BOXEO:Saco profesional boxeo y MMA de 100 lb.Fabricado con doble costura en lona impermeable de alta resistencia, tiene 100 cm de largo y 34 cm de diámetro, viene con reatas de seguridad de 40 cm y argolla acerada soldada para colgarlo donde desees.Podrás entrenar con los puños o las piernas, se recomienda hacer el relleno con retazo de tela o aserrín pulverizado.El saco SE ENVIA SIN RELLENO, también tenemos opción de enviarlo con relleno en otra publicación: https://articulo.mercadolibre.com.co/MCO-580890911-combo-saco-de-boxeo-100-cm-relleno-soporte-guantes-mma-_JMSOPORTE EN HIERRO ACERADO:INCLUYE CHAZOS Y MOSQUETON.Tiene 40 cm de largo para asegurar la separación adecuada del saco a la pared y facilitar entrenamiento de pierna,Con 4 anclajes para mayor seguridad, soporta 100 kg pero dependerá del tipo de pared a la cual se ponga el soporte.GUANTES MMA:Los guantes están fabricados en material PVC tipo cuero sintético, cubre la parte externa de la mano protegiendo los nudillos, mientras que el interior de la mano permanece abierto para facilitar la ventilación y reducir la sudoración. Tiene elástico con velcro para ajustar a la muñeca.Tamaño único, con aproximadamente 22 cm de largo sirve tanto para hombre como mujer.', 150000, 3, 110, 5, 1, 1, '592707178'),
(413, 'Conjunto Deportivo 3 Piezas Lycra Dama Fit - Gym', '123456789', 'Conjunto Deportivo 3 Piezas Lycra Dama Fit - GymCantidad de Piezas: 3Talla: Única (recomendado para S y M) Material: Nylon Power 100% Poliéster. Diseños: tenemos un catalogo muy amplio con diseños estampados y diseños en solo tono. Tiro: Pretina alta y Reforzada con control Abdomen. El conjunto deportivo es ideal para utilizarlo en actividades deportivas como Gimnasio, Running, Ciclismo, Natación, Crossfit, Aerobicos, Yoga, Pilates, o simplemente para sentirte cómoda en casa. la ventaja del Nylon Power es que el calibre de la tela no permite que sea traslucida y que marque aquello que no queremos mostrar, a su vez permanece ajustada durante la actividad y no se enrolla. Somos una tienda con gran variedad de prendas para Gimnasio por lo cual te invitamos a dar clic en \"otras publicaciones de este vendedor para que armes todas las prendas que requieras para la actividad deportiva\" y con la opción carrito de compras realizas un solo pago y los productos serán enviados en un mismo empaque. Recuerda que tu compra esta protegida y los envíos se realizaran por correo certificado. (MercadoEnvíos)', 62900, 1, 242, 5, 1, 1, '593158933'),
(414, 'Inflador De Llantas Mini Compresor 12v Carro Auto 300psi ', '123456789', 'Somos Ferreco, Ferretería & Hogar. Tenemos a tu disposición los mejores artículos del sector ferretero y diferentes productos para tu hogar. Con nosotros tienes asegurados tres pilares: *Seguridad – Calidad – Rapidez*________________________________________________________________Compresor 300 Psi WolfoxUn compresor de aire de 300 PSI marca Wolfox con el cual podrás inflar de nuevo los neumáticos de tu vehículo para mantenerlos perfectamente balanceados. Cuenta con un nanómetro de precisión para reportar el nivel de presión existente y un adaptador para auto de 12v. Su motor te será de utilidad en cualquier ocasión en la que necesites inflar diferentes elementos.*Adaptador de auto 12 volts*Manometro calibrador*Cable de 2.7m*Manguera de 47 cm*300 psiIncluye adaptadores para Inflables y balones_______________________________________________________________________Datos Importantes:*Todos nuestros productos son nuevos y originales*Somos distribuidores autorizados de las diferentes marcas que ofertamos*Todas nuestras ventas tienen el respaldo y seguridad de Mercadolibre y MercadoenviosPREGUNTAS FRECUENTES:¿Cuánto se demora mi pedido?Este tiempo depende del lugar a donde se haga el envío. Normalmente se tarda de 1 a 3 días hábiles.¿Me pueden enviar información de contacto?Por políticas de Mercado Libre no podemos suministrar datos de contacto como respuesta a preguntas, nos puedes encontrar como FERRECO.¿Es posible retirar el producto en sus instalaciones?Actualmente no contamos con esta opción, pero tus productos llegarán a tu domicilio totalmente seguros y garantizados.¿Cuáles son los medios de pago?Todos los habilitados por MERCADOPAGO, puedes cancelar por Transferencia Bancaria, Tarjetas de Crédito y Efecty sin costo adicional.', 39990, 2, 12, 5, 3, 1, '593261040'),
(415, 'Control Xbox Wireless Azul Deslumbrante', '123456789', '___________| Tienda Oficial |___________Preguntas frecuentes:¿Cómo puedo pagar mi compra?Podrás hacerlo con tarjeta de crédito, débito, transferencia bancaria o en efectivo a través de una red de cobranza.No es posible pagar a contra entrega, todos los pagos se deben realizar a través de Mercado pago.¿Es seguro comprar en Mercado Libre?Con el programa de compra protegida, no tienes de qué preocuparte ¿No recibiste lo que esperabas? ¿Te arrepentiste? Te devolvemos el dinero.¿Cuál es el costo de envío? El costo de envío puedes verlo desde el checkout de compra o si ya realizaste la misma, desde el detalle de la operación.Depende de varios factores, como el tamaño del producto y la distancia recorrida para su entrega. En caso de que tu producto valga más de $ 70.000, ¡el envío es totalmente gratis!¿Cuándo recibiré mi producto?Podrás ver el plazo de entrega en la confirmación de la compra o posteriormente en el detalle de la operación.¿Hacen Factura? Sí, hacemos factura. La misma se genera de forma automática a partir de los datos que cargas al momento de completar el checkout de tu compra, estos pueden ser a nombre de una persona física o empresa. Te pedimos que cargues la documentación correspondiente al efectuar la compra, en la sección \"Completa los datos para tu factura\"._____________________________________________________________Ante cualquier duda, no dudes en plantearla en la sección de “Preguntas”.', 289900, 3, 222, 5, 9, 1, '593323182'),
